!
! This module contains a number of procedures that return CO2 properties calculated using an interpolated Helmholtz free energy and its derivatives.
! The pressure range is 100.0 kPa to 30,000 kPa, and the temperature range is 250.0 K to 1275 K.
!
! The general format of the subroutine calls is CO2_XY, where X and Y correspond to the known independent properties.  The available routines are:
!     CO2_TD(temp,dens,error_code,pres,vol,qual,inte,enth,entr,cv,cp,ssnd,cond,visc)
!     CO2_TP(temp,pres,error_code,dens,vol,qual,inte,enth,entr,cv,cp,ssnd,cond,visc)
!     CO2_TQ(temp,qual,error_code,temp,pres,dens,vol,inte,enth,cv,cp,ssnd,cond,visc)
!     CO2_PQ(pres,qual,error_code,temp,dens,vol,inte,enth,entr,cv,cp,ssnd,cond,visc)
!     CO2_PH(pres,enth,error_code,temp,dens,vol,qual,inte,entr,cv,cp,ssnd,cond,visc)
!     CO2_PS(pres,entr,error_code,temp,dens,vol,qual,inte,enth,cv,cp,ssnd,cond,visc)
!     CO2_TS(temp,entr,error_code,pres,dens,vol,qual,inte,enth,cv,cp,ssnd,cond,visc)
!     CO2_HS(enth,entr,error_code,temp,pres,dens,vol,qual,inte,cv,cp,ssnd,cond,visc)
!     CO2_DS(dens,entr,error_code,temp,pres,vol,qual,inte,enth,cv,cp,ssnd,cond,visc)
! With:
!     error_code = an integer error code that can be used with the CO2_get_error_message subroutine
!     temp = temperature (K)
!     pres = pressure (kPa)
!     dens = density (kg/m3)
!     vol  = specific volume (m3/kg)
!     qual = quality on a mass basis that follows the REFPROP convention of:
!             q < 0 is a subcooled liquid
!             q = 0 is a saturated liquid
!             q = 1 is a saturated vapor
!             q > 1 is a superheated vapor
!             q = 998 is a superheated vapor with temperature greater than the critical temperature
!             q = 999 is supercritical, with temperature and density/pressure greater than the critical point
!     inte = internal energy (kJ/kg)
!     enth = enthalpy (kJ/kg)
!     entr = entropy (kJ/kg-K)
!     cv   = specific heat at constant volume (kJ/kg-K)
!     cp   = specific heat at constant pressure (kJ/kg-K)
!     ssnd = speed of sound in the fluid (m/s) 
!     cond = thermal conductivity (W/m-K)
!     visc = viscosity (Pa-s)
! Note: The first three arguments are always required; all other arguments are optional and can be excluded.
!       For example, to get the speed of sound given pressure and enthalpy, use: call CO2_PH(pres,enth,error_code,ssnd=speed_of_sound)
! For more information or if you have any questions please contact Northland Numerics at: info@nnumerics.com


module CO2_properties
implicit none
private
public :: CO2_info, CO2_get_error_message, CO2_TD, CO2_TP, CO2_TQ, CO2_PQ, CO2_PH, CO2_PS, CO2_TS, CO2_HS, CO2_DS

! Parameters
integer, parameter  :: sp           = selected_real_kind(6)
integer, parameter  :: dp           = selected_real_kind(15)
real(dp), parameter :: T_crit       = 304.1282_dp
real(dp), parameter :: P_crit       = 7377.3_dp
real(dp), parameter :: D_crit       = 467.6_dp
real(dp), parameter :: T_low_limit  = 250.0_dp
real(dp), parameter :: T_high_limit = 1275.0_dp
real(dp), parameter :: P_low_limit  = 100.0_dp
real(dp), parameter :: P_high_limit = 30000.0_dp
real(dp), parameter :: T_sat_min    = 250.0_dp
real(dp), parameter :: P_sat_min    = 1785.045_dp

! User-Defined Types
type thermo_obj
    real(dp) :: temp
    real(sp) :: left_D, inv_dD
    real(sp), dimension(6,3) :: c
end type thermo_obj
type thermo_subelement_obj
    real(dp) :: low_T
    real(sp) :: inv_dT
    real(sp), dimension(6,6) :: c
end type thermo_subelement_obj
type transport_subelement_obj
    real(dp) :: low_T
    real(sp) :: inv_dT
    real(sp), dimension(4,4) :: c
end type transport_subelement_obj
type sat_obj
    integer,  dimension(0:1) :: element
    real(dp), dimension(0:1) :: dens
    real(sp), dimension(0:1) :: x
end type sat_obj

