subroutine CO2_info(T_critical,D_critical,P_critical,temp_lower_limit,temp_upper_limit,pres_lower_limit,pres_upper_limit)
    real(dp), intent(out) :: T_critical,D_critical,P_critical,temp_lower_limit,temp_upper_limit,pres_lower_limit,pres_upper_limit
    T_critical = T_crit
    D_critical = D_crit
    P_critical = P_crit
    temp_lower_limit = T_low_limit
    temp_upper_limit = T_high_limit
    pres_lower_limit = P_low_limit
    pres_upper_limit = P_high_limit
end subroutine CO2_info

integer function first_row(temp)
    real(dp), intent(in) :: temp
    if (temp < 330.0_dp) then
        first_row = int((temp - 250.0_dp) * 2.50000000e-01_dp) + 1
    else if (temp < 362.0_dp) then
        first_row = int((temp - 330.0_dp) * 1.25000000e-01_dp) + 21
    else if (temp < 378.0_dp) then
        first_row = int((temp - 362.0_dp) * 6.25000000e-02_dp) + 25
    else if (temp < 506.0_dp) then
        first_row = int((temp - 378.0_dp) * 3.12500000e-02_dp) + 26
    else if (temp < 634.0_dp) then
        first_row = int((temp - 506.0_dp) * 1.56250000e-02_dp) + 30
    else if (temp < 1018.0_dp) then
        first_row = int((temp - 634.0_dp) * 7.81250000e-03_dp) + 32
    else
        first_row = int((temp - 1018.0_dp) * 3.90625000e-03_dp) + 35
    end if
end function first_row

