real(dp) function viscosity(temp,x,index)
    real(dp), intent(in) :: temp
    real(sp), intent(in) :: x
    integer, intent(in)  :: index
    real(sp)             :: y, c(4)
    y = (real(temp,sp) - visc_elements(1,5,index)) * visc_elements(2,5,index)
    c = ((visc_elements(1:4,4,index) * y + visc_elements(1:4,3,index)) * y + visc_elements(1:4,2,index)) * y + visc_elements(1:4,1,index)
    viscosity = real(c(1) + x * (c(2) + x * (c(3) + x * c(4))),dp)
end function viscosity

real(dp) function conductivity(temp,x,index)
    real(dp), intent(in) :: temp
    real(sp), intent(in) :: x
    integer, intent(in)  :: index
    integer              :: subelement
    real(sp)             :: y, c(4)
    if (cond_elements(4,5,index) > 0 .and. real(temp,sp) < cond_elements(1,5,index)) then                                            ! this element contains subelements
        do subelement = int(cond_elements(3,5,index)) , int(cond_elements(4,5,index)) - 1  ! search from top to bottom until the correct subelement is found (bottom subelement is used if none found)
            if (temp >= cond_subelements(subelement)%low_T) exit
        end do
        y = real((temp - cond_subelements(subelement)%low_T),sp) * cond_subelements(subelement)%inv_dT
        c = ((cond_subelements(subelement)%c(1:4,4) * y + cond_subelements(subelement)%c(1:4,3)) * y + cond_subelements(subelement)%c(1:4,2)) * y + cond_subelements(subelement)%c(1:4,1)
    else
        y = (real(temp,sp) - cond_elements(1,5,index)) * cond_elements(2,5,index)
        c = ((cond_elements(1:4,4,index) * y + cond_elements(1:4,3,index)) * y + cond_elements(1:4,2,index)) * y + cond_elements(1:4,1,index)
    end if
    conductivity = real(c(1) + x * (c(2) + x * (c(3) + x * c(4))),dp)
end function conductivity

elemental subroutine init_thermo(thermo,index,temp)
    class(thermo_obj), intent(out) :: thermo
    integer, intent(in)            :: index
    real(dp), intent(in)           :: temp
    real(sp)                       :: inv_dT, y, coefs(6,6)
    integer                        :: subelement
    
    ! Initialize thermo object with temperature, density, and coefficient data.
    thermo%temp   = temp
    thermo%left_D = elements(3,7,index)
    thermo%inv_dD = elements(4,7,index)    
    if (elements(6,7,index) > 0 .and. temp < elements(1,7,index)) then           ! this element contains subelements
        do subelement = int(elements(5,7,index)), int(elements(6,7,index))-1     ! search from top to bottom until the correct subelement is found
            if (temp >= subelements(subelement)%low_T) exit
        end do
        inv_dT = subelements(subelement)%inv_dT
        coefs  = subelements(subelement)%c
        y = real((temp - subelements(subelement)%low_T),sp) * inv_dT
    else
        inv_dT = elements(2,7,index)
        coefs  = elements(:,1:6,index)
        y = (real(temp,sp) - elements(1,7,index)) * inv_dT
    end if
    
    ! Evaluate polynomial, first derivative, and second derivative at specified temperature.
    thermo%c(:,1) = coefs(1:6,6)
    thermo%c(:,2) = thermo%c(:,1)
    thermo%c(:,1) = thermo%c(:,1) * y + coefs(1:6,5)
    thermo%c(:,3) = thermo%c(:,2)
    thermo%c(:,2) = thermo%c(:,2) * y + thermo%c(:,1)
    thermo%c(:,1) = thermo%c(:,1) * y + coefs(1:6,4)
    thermo%c(:,3) = thermo%c(:,3) * y + thermo%c(:,2)
    thermo%c(:,2) = thermo%c(:,2) * y + thermo%c(:,1)
    thermo%c(:,1) = thermo%c(:,1) * y + coefs(1:6,3)
    thermo%c(:,3) = thermo%c(:,3) * y + thermo%c(:,2)
    thermo%c(:,2) = thermo%c(:,2) * y + thermo%c(:,1)
    thermo%c(:,1) = thermo%c(:,1) * y + coefs(1:6,2)
    thermo%c(:,3) = 2.0_sp * (thermo%c(:,3) * y + thermo%c(:,2))
    thermo%c(:,2) = thermo%c(:,2) * y + thermo%c(:,1)
    thermo%c(:,1) = thermo%c(:,1) * y + coefs(1:6,1)
    thermo%c(:,2) = inv_dT * thermo%c(:,2)
    thermo%c(:,3) = inv_dT * inv_dT * thermo%c(:,3)

    return
end subroutine init_thermo

subroutine eval_using_x(thermo,x,pres,dens,vol,inte,enth,entr,cv,cp,ssnd)
    class(thermo_obj), intent(in)   :: thermo
    real(sp), intent(in)            :: x
    real(dp), intent(out), optional :: pres,dens,vol,inte,enth,entr,cv,cp,ssnd
    real(dp)                        :: dens_internal, dfdD, dfdD2, dfdDdT, f_dfdT_dfdT2(3)

    ! Calculate density, Helmholtz free energy, and derivatives.
    dens_internal = real( thermo%left_D + x / thermo%inv_dD, dp)  ! calculate the density given the fractional position within the element
    dfdD = real( thermo%inv_dD * (thermo%c(2,1) + x * (2 * thermo%c(3,1) + x * (3 * thermo%c(4,1) + x * (4 * thermo%c(5,1) + x * 5 * thermo%c(6,1))))) ,dp)  ! derivative of f w.r.t. density
    if (present(cp) .or. present(ssnd)) then  ! value, first, second, and cross-derivative are required
        f_dfdT_dfdT2(1:3) = real( thermo%c(1,1:3) + x * (thermo%c(2,1:3) + x * (thermo%c(3,1:3) + x * (thermo%c(4,1:3) + x * (thermo%c(5,1:3) + x * thermo%c(6,1:3))))), dp)
        dfdD2             = real( thermo%inv_dD**2 * (2 * thermo%c(3,1) + x * (6 * thermo%c(4,1) + x * (12 * thermo%c(5,1) + x * 20 * thermo%c(6,1)))), dp)
        dfdDdT            = real( thermo%inv_dD * (thermo%c(2,2) + x * (2 * thermo%c(3,2) + x * (3 * thermo%c(4,2) + x * (4 * thermo%c(5,2) + x * 5 * thermo%c(6,2))))), dp)
    else if (present(cv)) then  ! value, first, and second derivative are required
        f_dfdT_dfdT2(1:3) = real( thermo%c(1,1:3) + x * (thermo%c(2,1:3) + x * (thermo%c(3,1:3) + x * (thermo%c(4,1:3) + x * (thermo%c(5,1:3) + x * thermo%c(6,1:3))))) ,dp)
    else  ! only value and first derivative are required
        f_dfdT_dfdT2(1:2) = real( thermo%c(1,1:2) + x * (thermo%c(2,1:2) + x * (thermo%c(3,1:2) + x * (thermo%c(4,1:2) + x * (thermo%c(5,1:2) + x * thermo%c(6,1:2))))) ,dp)
    end if
    
    ! Calculate required properties.
    if (present(dens)) dens = dens_internal
    if (present(vol))  vol  = 1.0_dp / dens_internal
    if (present(pres)) pres = dens_internal**2 * dfdD
    if (present(inte)) inte = f_dfdT_dfdT2(1) - thermo%temp * f_dfdT_dfdT2(2)
    if (present(enth)) enth = f_dfdT_dfdT2(1) - thermo%temp * f_dfdT_dfdT2(2) + dens_internal * dfdD
    if (present(entr)) entr = -f_dfdT_dfdT2(2)
    if (present(cv))   cv   = -thermo%temp * f_dfdT_dfdT2(3)
    if (present(cp))   cp   = -thermo%temp * f_dfdT_dfdT2(3) + thermo%temp * dens_internal**2 * dfdDdT**2 / (2.0_dp * dens_internal * dfdD + dens_internal**2 * dfdD2)
    if (present(ssnd)) ssnd = sqrt( 1000.0_dp * dens_internal * (dens_internal * dfdD2 * f_dfdT_dfdT2(3) - dens_internal * dfdDdT**2 + 2.0_dp * dfdD * f_dfdT_dfdT2(3)) / f_dfdT_dfdT2(3) )
    
    return
end subroutine eval_using_x

subroutine eval_using_dens(thermo,dens,x,pres,vol,inte,enth,entr,cv,cp,ssnd)
    class(thermo_obj), intent(in)   :: thermo
    real(dp), intent(in)            :: dens
    real(sp), intent(out)           :: x
    real(dp), intent(out), optional :: pres,vol,inte,enth,entr,cv,cp,ssnd
    real(dp)                        :: dfdD, dfdD2, dfdDdT, f_dfdT_dfdT2(3)
    
    ! Calculate fractional position, Helmholtz free energy, and derivatives.
    x = (real(dens,sp) - thermo%left_D) * thermo%inv_dD
    dfdD = real( thermo%inv_dD * (thermo%c(2,1) + x * (2 * thermo%c(3,1) + x * (3 * thermo%c(4,1) + x * (4 * thermo%c(5,1) + x * 5 * thermo%c(6,1))))) ,dp)
    if (present(cp) .or. present(ssnd)) then ! value, first, second, and cross-derivative are required
        f_dfdT_dfdT2(1:3) = real( thermo%c(1,1:3) + x * (thermo%c(2,1:3) + x * (thermo%c(3,1:3) + x * (thermo%c(4,1:3) + x * (thermo%c(5,1:3) + x * thermo%c(6,1:3))))) ,dp)
        dfdD2             = real( thermo%inv_dD**2 * (2 * thermo%c(3,1) + x * (6 * thermo%c(4,1) + x * (12 * thermo%c(5,1) + x * 20 * thermo%c(6,1)))) ,dp)
        dfdDdT            = real( thermo%inv_dD * (thermo%c(2,2) + x * (2 * thermo%c(3,2) + x * (3 * thermo%c(4,2) + x * (4 * thermo%c(5,2) + x * 5 * thermo%c(6,2))))) ,dp)
    else if (present(cv)) then  ! value, first, and second derivative are required
        f_dfdT_dfdT2(1:3) = real( thermo%c(1,1:3) + x * (thermo%c(2,1:3) + x * (thermo%c(3,1:3) + x * (thermo%c(4,1:3) + x * (thermo%c(5,1:3) + x * thermo%c(6,1:3))))) ,dp)
    else  ! only value and first derivative are required
        f_dfdT_dfdT2(1:2) = real( thermo%c(1,1:2) + x * (thermo%c(2,1:2) + x * (thermo%c(3,1:2) + x * (thermo%c(4,1:2) + x * (thermo%c(5,1:2) + x * thermo%c(6,1:2))))) ,dp)
    end if

    ! Calculate required properties.
    if (present(pres)) pres = dens**2 * dfdD
    if (present(vol))  vol  = 1.0_dp / dens
    if (present(inte)) inte = f_dfdT_dfdT2(1) - thermo%temp * f_dfdT_dfdT2(2)
    if (present(enth)) enth = f_dfdT_dfdT2(1) - thermo%temp * f_dfdT_dfdT2(2) + dens * dfdD
    if (present(entr)) entr = -f_dfdT_dfdT2(2)
    if (present(cv))   cv   = -thermo%temp * f_dfdT_dfdT2(3)
    if (present(cp))   cp   = -thermo%temp * f_dfdT_dfdT2(3) + thermo%temp * dens**2 * dfdDdT**2 / (2.0_dp * dens * dfdD + dens**2 * dfdD2)
    if (present(ssnd)) ssnd = sqrt( 1000.0_dp * dens * (dens * dfdD2 * f_dfdT_dfdT2(3) - dens * dfdDdT**2 + 2.0_dp * dfdD * f_dfdT_dfdT2(3)) / f_dfdT_dfdT2(3) )
end subroutine eval_using_dens

subroutine eval_using_pres(thermo,pres,x,dens,vol,inte,enth,entr,cv,cp,ssnd,low_frac,high_frac)
    class(thermo_obj), intent(in) :: thermo
    real(dp), intent(in) :: pres
    real(sp), intent(out) :: x
    real(sp), intent(in), optional  :: low_frac, high_frac
    real(dp), intent(out), optional :: dens,vol,inte,enth,entr,cv,cp,ssnd
    real(sp) :: pres_sp, scaled_zero_tol, dD, x_low, x_high, left_pres_norm, right_pres_norm, pres_norm, x_m, dens_internal
    real(dp) :: dfdD, dfdD2, dfdDdT, f_dfdT_dfdT2(3)
    integer :: d_iter
    real(sp), parameter :: rel_zero_tol = 5e-5_sp

    pres_sp = real(pres,sp)
    scaled_zero_tol = rel_zero_tol * pres_sp
    dD = 1.0_sp / thermo%inv_dD

    if (present(low_frac)) then
        x_low = low_frac
        left_pres_norm = (thermo%left_D + x_low * dD)**2 * thermo%inv_dD * (thermo%c(2,1) + x_low * (2 * thermo%c(3,1) + x_low * (3 * thermo%c(4,1) + x_low * (4 * thermo%c(5,1) + x_low * 5 * thermo%c(6,1))))) - pres_sp
    else
        x_low = 0.0_sp
        left_pres_norm = thermo%left_D**2 * thermo%inv_dD * thermo%c(2,1) - pres_sp
    end if
    if (present(high_frac)) then
        x_high = high_frac
        right_pres_norm = (thermo%left_D + x_high * dD)**2 * thermo%inv_dD * (thermo%c(2,1) + x_high * (2 * thermo%c(3,1) + x_high * (3 * thermo%c(4,1) + x_high * (4 * thermo%c(5,1) + x_high * 5 * thermo%c(6,1))))) - pres_sp
    else
        x_high = 1.0_sp
        right_pres_norm = (thermo%left_D + dD)**2 * thermo%inv_dD * (thermo%c(2,1) + (2 * thermo%c(3,1) + (3 * thermo%c(4,1) + (4 * thermo%c(5,1) + 5 * thermo%c(6,1))))) - pres_sp
    end if

    dekker: do d_iter = 1,31
        if ((x_high-x_low) < 0.000001_sp) exit dekker
        x_m = (x_high + x_low) * 0.5_sp
        if (-left_pres_norm < right_pres_norm) then ! x_low is better starting point (note: left_pres_norm should always be negative)
            x = x_low - left_pres_norm * (x_low - x_high) / (left_pres_norm - right_pres_norm)
            if (x > x_m) x = x_m  ! want to stay closer to better root
        else  ! x_high is better starting point
            x = x_high - right_pres_norm * (x_high - x_low) / (right_pres_norm - left_pres_norm)
            if (x < x_m) x = x_m  ! want to stay closer to better root
        end if
        dfdD = real( thermo%inv_dD * (thermo%c(2,1) + x * (2 * thermo%c(3,1) + x * (3 * thermo%c(4,1) + x * (4 * thermo%c(5,1) + x * 5 * thermo%c(6,1))))) ,dp)
        dens_internal = thermo%left_D + x * dD
        pres_norm = dens_internal**2 * real(dfdD,sp) - pres_sp
        if (pres_norm < 0.0_sp) then
            if (-pres_norm < scaled_zero_tol) exit dekker
            left_pres_norm = pres_norm                                                                                                
            x_low = x
        else                  
            if (pres_norm < scaled_zero_tol) exit dekker                                                                                        
            right_pres_norm = pres_norm                                                                                               
            x_high = x
        end if     
    end do dekker

    if (present(cp) .or. present(ssnd)) then
        f_dfdT_dfdT2(1:3) = real( thermo%c(1,1:3) + x * (thermo%c(2,1:3) + x * (thermo%c(3,1:3) + x * (thermo%c(4,1:3) + x * (thermo%c(5,1:3) + x * thermo%c(6,1:3))))) ,dp)
        dfdD2             = real( thermo%inv_dD**2 * (2 * thermo%c(3,1) + x * (6 * thermo%c(4,1) + x * (12 * thermo%c(5,1) + x * 20 * thermo%c(6,1)))) ,dp)
        dfdDdT            = real( thermo%inv_dD * (thermo%c(2,2) + x * (2 * thermo%c(3,2) + x * (3 * thermo%c(4,2) + x * (4 * thermo%c(5,2) + x * 5 * thermo%c(6,2))))) ,dp)
    else if (present(cv)) then
        f_dfdT_dfdT2(1:3) = real( thermo%c(1,1:3) + x * (thermo%c(2,1:3) + x * (thermo%c(3,1:3) + x * (thermo%c(4,1:3) + x * (thermo%c(5,1:3) + x * thermo%c(6,1:3))))) ,dp)
    else
        f_dfdT_dfdT2(1:2) = real( thermo%c(1,1:2) + x * (thermo%c(2,1:2) + x * (thermo%c(3,1:2) + x * (thermo%c(4,1:2) + x * (thermo%c(5,1:2) + x * thermo%c(6,1:2))))) ,dp)
    end if

    if (present(dens)) dens = real( dens_internal ,dp)
    if (present(vol))  vol  = 1.0_dp / real( dens_internal ,dp)
    if (present(inte)) inte =  f_dfdT_dfdT2(1) - thermo%temp * f_dfdT_dfdT2(2)
    if (present(enth)) enth =  f_dfdT_dfdT2(1) - thermo%temp * f_dfdT_dfdT2(2) + real(dens_internal,dp) * dfdD
    if (present(entr)) entr =  -f_dfdT_dfdT2(2)
    if (present(cv))   cv   =  -thermo%temp * f_dfdT_dfdT2(3)
    if (present(cp))   cp   =  -thermo%temp * f_dfdT_dfdT2(3) + thermo%temp * real(dens_internal,dp)**2 * dfdDdT**2 / (2.0_dp * real(dens_internal,dp) * dfdD + real(dens_internal,dp)**2 * dfdD2)
    if (present(ssnd)) ssnd = sqrt( 1000.0_dp * real(dens_internal,dp) * (real(dens_internal,dp) * dfdD2 * f_dfdT_dfdT2(3) - real(dens_internal,dp) * dfdDdT**2 + 2.0_dp * dfdD * f_dfdT_dfdT2(3)) / f_dfdT_dfdT2(3) )
end subroutine eval_using_pres

subroutine eval_using_entr(thermo,entr,x,pres,dens,vol,inte,enth,cv,cp,ssnd,low_frac,high_frac)
    class(thermo_obj), intent(in) :: thermo
    real(dp), intent(in) :: entr
    real(sp), intent(out) :: x
    real(sp), intent(in), optional  :: low_frac, high_frac
    real(dp), intent(out), optional :: pres,dens,vol,inte,enth,cv,cp,ssnd
    real(sp) :: entr_sp, scaled_zero_tol, dD, x_low, x_high, left_entr_norm, right_entr_norm, entr_norm, x_m, dens_internal
    real(dp) :: dfdD, dfdD2, dfdDdT, f_dfdT_dfdT2(3)
    integer :: d_iter
    real(sp), parameter :: rel_zero_tol = 1e-6_sp

    entr_sp = real(entr,sp)
    scaled_zero_tol = rel_zero_tol * entr_sp
    dD = 1.0_sp / thermo%inv_dD

    if (present(low_frac)) then
        x_low = low_frac
        left_entr_norm = -(thermo%c(1,2) + x_low * (thermo%c(2,2) + x_low * (thermo%c(3,2) + x_low * (thermo%c(4,2) + x_low * (thermo%c(5,2) + x_low * thermo%c(6,2)))))) - entr_sp
    else
        x_low = 0.0_sp
        left_entr_norm = -(thermo%c(1,2)) - entr_sp
    end if
    if (present(high_frac)) then
        x_high = high_frac
        right_entr_norm = -(thermo%c(1,2) + x_high * (thermo%c(2,2) + x_high * (thermo%c(3,2) + x_high * (thermo%c(4,2) + x_high * (thermo%c(5,2) + x_high * thermo%c(6,2)))))) - entr_sp
    else
        x_high = 1.0_sp
        right_entr_norm = -(thermo%c(1,2) + (thermo%c(2,2) + (thermo%c(3,2) + (thermo%c(4,2) + (thermo%c(5,2) + thermo%c(6,2)))))) - entr_sp
    end if

    dekker: do d_iter = 1,51
        !if ((x_high-x_low) < 0.000001_sp) exit dekker
        x_m = (x_high + x_low) * 0.5_sp
        if (left_entr_norm < -right_entr_norm) then ! x_low is better starting point (note: right_entr_norm should always be negative)
            x = x_low - left_entr_norm * (x_low - x_high) / (left_entr_norm - right_entr_norm)
            if (x > x_m) x = x_m  ! want to stay closer to better root
        else  ! x_high is better starting point
            x = x_high - right_entr_norm * (x_high - x_low) / (right_entr_norm - left_entr_norm)
            if (x < x_m) x = x_m  ! want to stay closer to better root
        end if
        entr_norm = -(thermo%c(1,2) + x * (thermo%c(2,2) + x * (thermo%c(3,2) + x * (thermo%c(4,2) + x * (thermo%c(5,2) + x * thermo%c(6,2)))))) - entr_sp
        if (entr_norm > 0.0_sp) then
            if (entr_norm < scaled_zero_tol) exit dekker
            left_entr_norm = entr_norm                                                                                                
            x_low = x
        else
            if (-entr_norm < scaled_zero_tol) exit dekker                                                                                        
            right_entr_norm = entr_norm                                                                                               
            x_high = x
        end if     
    end do dekker

    dfdD = real( thermo%inv_dD * (thermo%c(2,1) + x * (2 * thermo%c(3,1) + x * (3 * thermo%c(4,1) + x * (4 * thermo%c(5,1) + x * 5 * thermo%c(6,1))))) ,dp)
    dens_internal = thermo%left_D + x * dD
    if (present(cp) .or. present(ssnd)) then
        f_dfdT_dfdT2(1:3) = real( thermo%c(1,1:3) + x * (thermo%c(2,1:3) + x * (thermo%c(3,1:3) + x * (thermo%c(4,1:3) + x * (thermo%c(5,1:3) + x * thermo%c(6,1:3))))) ,dp)
        dfdD2             = real( thermo%inv_dD**2 * (2 * thermo%c(3,1) + x * (6 * thermo%c(4,1) + x * (12 * thermo%c(5,1) + x * 20 * thermo%c(6,1)))) ,dp)
        dfdDdT            = real( thermo%inv_dD * (thermo%c(2,2) + x * (2 * thermo%c(3,2) + x * (3 * thermo%c(4,2) + x * (4 * thermo%c(5,2) + x * 5 * thermo%c(6,2))))) ,dp)
    else if (present(cv)) then
        f_dfdT_dfdT2(1:3) = real( thermo%c(1,1:3) + x * (thermo%c(2,1:3) + x * (thermo%c(3,1:3) + x * (thermo%c(4,1:3) + x * (thermo%c(5,1:3) + x * thermo%c(6,1:3))))) ,dp)
    else
        f_dfdT_dfdT2(1:2) = real( thermo%c(1,1:2) + x * (thermo%c(2,1:2) + x * (thermo%c(3,1:2) + x * (thermo%c(4,1:2) + x * (thermo%c(5,1:2) + x * thermo%c(6,1:2))))) ,dp)
    end if

    if (present(pres)) pres = real(dens_internal,dp)**2 * dfdD
    if (present(dens)) dens = real( dens_internal ,dp)
    if (present(vol))  vol  = 1.0_dp / real( dens_internal ,dp)
    if (present(inte)) inte =  f_dfdT_dfdT2(1) - thermo%temp * f_dfdT_dfdT2(2)
    if (present(enth)) enth =  f_dfdT_dfdT2(1) - thermo%temp * f_dfdT_dfdT2(2) + real(dens_internal,dp) * dfdD
    if (present(cv))   cv   =  -thermo%temp * f_dfdT_dfdT2(3)
    if (present(cp))   cp   =  -thermo%temp * f_dfdT_dfdT2(3) + thermo%temp * real(dens_internal,dp)**2 * dfdDdT**2 / (2.0_dp * real(dens_internal,dp) * dfdD + real(dens_internal,dp)**2 * dfdD2)
    if (present(ssnd)) ssnd = sqrt( 1000.0_dp * real(dens_internal,dp) * (real(dens_internal,dp) * dfdD2 * f_dfdT_dfdT2(3) - real(dens_internal,dp) * dfdDdT**2 + 2.0_dp * dfdD * f_dfdT_dfdT2(3)) / f_dfdT_dfdT2(3) )
end subroutine eval_using_entr

real(dp) function calc_left_pres(index,temp)
    integer, intent(in)  :: index
    real(dp), intent(in) :: temp
    real(sp)             :: y, dens_factor
    integer              :: subelement
    
    dens_factor = elements(3,7,index)**2 * elements(4,7,index)                                                  ! this doesn't change even if there are subelements
    if (elements(6,7,index) > 0 .and. temp < elements(1,7,index)) then                                          ! this element has subelements
        do subelement = int(elements(5,7,index)), int(elements(6,7,index))-1     ! search from top to bottom until the correct subelement is found
            if (temp >= subelements(subelement)%low_T) exit
        end do
        y = real((temp - subelements(subelement)%low_T),sp) * subelements(subelement)%inv_dT
        calc_left_pres = dens_factor * (((((subelements(subelement)%c(2,6) * y + subelements(subelement)%c(2,5)) * y + subelements(subelement)%c(2,4)) * y + subelements(subelement)%c(2,3)) * y + subelements(subelement)%c(2,2)) * y + subelements(subelement)%c(2,1))
    else
       y = (real(temp,sp) - elements(1,7,index)) * elements(2,7,index)
       calc_left_pres = real( dens_factor * (((((elements(2,6,index) * y + elements(2,5,index)) * y + elements(2,4,index)) * y + elements(2,3,index)) * y + elements(2,2,index)) * y + elements(2,1,index)) ,dp)
    end if
end function calc_left_pres

real(dp) function calc_pres(index,temp,x)
    integer, intent(in)  :: index
    real(dp), intent(in) :: temp
    real(sp), intent(in) :: x
    real(sp)             :: y, dens_factor, c(6)
    integer              :: subelement
    
    dens_factor = (elements(3,7,index) + x / elements(4,7,index))**2 * elements(4,7,index)                      ! this doesn't change even if there are subelements
    if (elements(6,7,index) > 0 .and. temp < elements(1,7,index)) then                                          ! this element has subelements
        do subelement = int(elements(5,7,index)), int(elements(5,7,index))-1     ! search from top to bottom until the correct subelement is found
            if (temp >= subelements(subelement)%low_T) exit
        end do
        y = real((temp - subelements(subelement)%low_T),sp) * subelements(subelement)%inv_dT
        c = ((((subelements(subelement)%c(1:6,6) * y + subelements(subelement)%c(1:6,5)) * y + subelements(subelement)%c(1:6,4)) * y + subelements(subelement)%c(1:6,3)) * y + subelements(subelement)%c(1:6,2)) * y + subelements(subelement)%c(1:6,1)
    else
        y = (real(temp,sp) - elements(1,7,index)) * elements(2,7,index)
        c = ((((elements(1:6,6,index) * y + elements(1:6,5,index)) * y + elements(1:6,4,index)) * y + elements(1:6,3,index)) * y + elements(1:6,2,index)) * y + elements(1:6,1,index)
    end if
    calc_pres = real( dens_factor * (c(2) + x * (2 * c(3) + x * (3 * c(4) + x * (4 * c(5) + x * 5 * c(6))))) ,dp)
end function calc_pres


real(dp) function calc_left_entr(index,temp)
    integer, intent(in)  :: index
    real(dp), intent(in) :: temp
    real(sp)             :: y
    integer              :: subelement
    
    if (elements(6,7,index) > 0 .and. temp < elements(1,7,index)) then                                          ! this element has subelements
        do subelement = int(elements(5,7,index)), int(elements(6,7,index))-1     ! search from top to bottom until the correct subelement is found
            if (temp >= subelements(subelement)%low_T) exit
        end do
        y = real((temp - subelements(subelement)%low_T),sp) * subelements(subelement)%inv_dT
        calc_left_entr = -((((5 * subelements(subelement)%c(1,6) * y + 4 * subelements(subelement)%c(1,5)) * y + 3 * subelements(subelement)%c(1,4)) * y + 2 * subelements(subelement)%c(1,3)) * y + subelements(subelement)%c(1,2))
    else
        y = (real(temp,sp) - elements(1,7,index)) * elements(2,7,index)
        calc_left_entr = -elements(2,7,index)*((((5 * elements(1,6,index) * y + 4 * elements(1,5,index)) * y + 3 * elements(1,4,index)) * y + 2 * elements(1,3,index)) * y + elements(1,2,index))
    end if

end function calc_left_entr

subroutine quick_prop(temp,pres,prop_code,liquid,element,x,value,error_code)
    real(dp), intent(in) :: temp, pres
    integer, intent(in) :: prop_code  ! 1: dens, 2: entr, 3: enth
    logical, intent(in) :: liquid
    integer, intent(out) :: element, error_code
    real(sp), intent(out) :: x
    real(dp), intent(out) :: value
    type(sat_obj) :: sat
    logical  :: found_row
    integer  :: row, low, high, first, last, subelement, d_iter
    real(sp) :: pres_sp, inv_dT, inv_dD, dD, left_D, y
    real(sp) :: scaled_zero_tol, x_low, x_high, left_pres_norm, right_pres_norm, pres_norm, x_m, dens_internal
    real(dp) :: f, dfdT, dfdD
    real(sp), dimension(6,6) :: coefs
    real(sp), dimension(6) :: f_c, dfdT_c
    real(sp), parameter :: rel_zero_tol = 5e-5_sp




    ! Initialize variables.
    error_code = 0
    pres_sp = real(pres,sp)
    sat%element = -1
    scaled_zero_tol = rel_zero_tol * pres_sp
    row = first_row(temp)
	if (temp < T_low_limit) then
		print *,'here dude! (temp too low)'
		print *,temp
		stop
	end if
	if (temp > T_high_limit) then
		print *,'here dude! (temp too high)'
		print *,temp
		stop
	end if


if (row < 1) then
	print *,temp,pres,prop_code
	stop
end if
    first = row_info(1,row)  ! first element in this row
    last = row_info(2,row)   ! last element in this row

    ! Find the row containing the pressure.
    if (pres < calc_left_pres(first,temp)) then ! specified pressure is to the left of this row
        found_row = .false.
        do while (.not. found_row)                                  ! loop over rows until the correct one is found
            row = row_info(3,row)                                   ! reset current row to next row
            first = row_info(1,row)                                 ! reset the first element
            found_row = (pres >= calc_left_pres(first,temp))  ! true if the specified pressure lies within this row
        end do
        last = row_info(2,row)                                      ! reset the last element
    else ! pressure is in the first row
        if (temp < T_crit) then ! need to check the vapor dome
            call init_sat(temp,row,sat)                          ! initialize the saturation object
            if (liquid) then ! must be to the right of the dome
                first = sat%element(0)
            else ! must be to the left of the dome
                last = sat%element(1)
            end if
        end if
    end if



    ! Find the element containing the specified pressure using a binary search.
    low = first
    high = last
    do while (low + 1 < high)
        element = (low + high) / 2                          ! note: integer division
        if (pres < calc_left_pres(element,temp)) then ! given pressure is to the left of this element
            high = element
        else
            low = element
        end if
    end do
    if (pres >= calc_left_pres(high,temp)) then       ! determines if the correct element is 'low' or 'last'
        element = last
    else
        element = low
    end if
    
    ! The element has been identified - calculate the temperature-dependent part of the polynomial.
    left_D = elements(3,7,element)
    inv_dD = elements(4,7,element) 
    dD = 1.0_sp / inv_dD
    if (elements(6,7,element) > 0 .and. temp < elements(1,7,element)) then                                          ! this element has subelements
        do subelement = int(elements(5,7,element)), int(elements(5,7,element))-1    ! search from top to bottom until the correct subelement is found
            if (temp >= subelements(subelement)%low_T) exit
        end do
        inv_dT = subelements(subelement)%inv_dT
        coefs  = subelements(subelement)%c
        y = real((temp - subelements(subelement)%low_T),sp) * inv_dT
    else
        inv_dT = elements(2,7,element)
        coefs  = elements(:,1:6,element)
        y = (real(temp,sp) - elements(1,7,element)) * inv_dT
    end if
    if (prop_code == 1) then ! just need f (dfdD) for pressure
        f_c = (((((coefs(1:6,6)) * y + coefs(1:6,5)) * y + coefs(1:6,4)) * y + coefs(1:6,3)) * y + coefs(1:6,2)) * y + coefs(1:6,1)
    else
        f_c = coefs(1:6,6)
        dfdT_c = f_c
        f_c = f_c * y + coefs(1:6,5)
        dfdT_c = dfdT_c * y + f_c
        f_c = f_c * y + coefs(1:6,4)
        dfdT_c = dfdT_c * y + f_c
        f_c = f_c * y + coefs(1:6,3)
        dfdT_c = dfdT_c * y + f_c
        f_c = f_c * y + coefs(1:6,2)
        dfdT_c = dfdT_c * y + f_c
        f_c = f_c * y + coefs(1:6,1)
        dfdT_c = inv_dT * dfdT_c
    end if



    ! Find the x that corresponds to the given pressure.    
    if (element == sat%element(0)) then
        x_low = sat%x(0) - 0.001_sp
        left_pres_norm = (left_D + x_low * dD)**2 * inv_dD * (f_c(2) + x_low * (2 * f_c(3) + x_low * (3 * f_c(4) + x_low * (4 * f_c(5) + x_low * 5 * f_c(6))))) - pres_sp
        x_high = 1.0_sp
        right_pres_norm = (left_D + dD)**2 * inv_dD * (f_c(2) + (2 * f_c(3) + (3 * f_c(4) + (4 * f_c(5) + 5 * f_c(6))))) - pres_sp
    else if (element == sat%element(1)) then
        x_low = 0.0_sp
        left_pres_norm = left_D**2 * inv_dD * f_c(2) - pres_sp
        x_high = sat%x(1) + 0.001_sp
        right_pres_norm = (left_D + x_high * dD)**2 * inv_dD * (f_c(2) + x_high * (2 * f_c(3) + x_high * (3 * f_c(4) + x_high * (4 * f_c(5) + x_high * 5 * f_c(6))))) - pres_sp
    else
        x_low = 0.0_sp
        left_pres_norm = left_D**2 * inv_dD * f_c(2) - pres_sp
        x_high = 1.0_sp
        right_pres_norm = (left_D + dD)**2 * inv_dD * (f_c(2) + (2 * f_c(3) + (3 * f_c(4) + (4 * f_c(5) + 5 * f_c(6))))) - pres_sp
    end if

    dekker: do d_iter = 1,51
        if ((x_high-x_low) < 0.000001_sp) exit dekker
        x_m = (x_high + x_low) * 0.5_sp
        if (-left_pres_norm < right_pres_norm) then ! x_low is better starting point (note: left_pres_norm should always be negative)
            x = x_low - left_pres_norm * (x_low - x_high) / (left_pres_norm - right_pres_norm)
            if (x > x_m) x = x_m  ! want to stay closer to better root
        else  ! x_high is better starting point
            x = x_high - right_pres_norm * (x_high - x_low) / (right_pres_norm - left_pres_norm)
            if (x < x_m) x = x_m  ! want to stay closer to better root
        end if
        dfdD = real( inv_dD * (f_c(2) + x * (2 * f_c(3) + x * (3 * f_c(4) + x * (4 * f_c(5) + x * 5 * f_c(6))))) ,dp)
        dens_internal = left_D + x * dD
        pres_norm = dens_internal**2 * real(dfdD,sp) - pres_sp
        if (pres_norm < 0.0_sp) then
            if (-pres_norm < scaled_zero_tol) exit dekker
            left_pres_norm = pres_norm                                                                                                
            x_low = x
        else                  
            if (pres_norm < scaled_zero_tol) exit dekker                                                                                        
            right_pres_norm = pres_norm                                                                                               
            x_high = x
        end if     
    end do dekker

    if (d_iter > 40) then
        error_code = 110
        return
    end if

    select case (prop_code)
        case(1) ! density
            value = real( dens_internal ,dp)
        case(2) ! entropy
            value = -real( dfdT_c(1) + x * (dfdT_c(2) + x * (dfdT_c(3) + x * (dfdT_c(4) + x * (dfdT_c(5) + x * dfdT_c(6))))) ,dp)
        case(3) ! enthalpy
            f = real( f_c(1) + x * (f_c(2) + x * (f_c(3) + x * (f_c(4) + x * (f_c(5) + x * f_c(6))))) ,dp)
            dfdT = real( dfdT_c(1) + x * (dfdT_c(2) + x * (dfdT_c(3) + x * (dfdT_c(4) + x * (dfdT_c(5) + x * dfdT_c(6))))) ,dp)
            value =  f - temp * dfdT + real(dens_internal,dp) * dfdD
    end select



    return
end subroutine quick_prop
subroutine CO2_TD(temp,dens,error_code,pres,vol,qual,inte,enth,entr,cv,cp,ssnd,cond,visc)
    !!! Subroutine used to determine fluid properties given temperature and density.  An array of inputs can be used if the outputs have a conforming size and shape.
    !!! Required Inputs:
    !!!   temp = temperature (K)
    !!!   dens = density (kg/m3)
    !!! Required Outputs:
    !!!   error_code = an integer error code that can be used with the get_error_message subroutine
    !!! Optional Outputs:
    !!!   pres = pressure (kPa)
    !!!   vol = specific volume (m3/kg)
    !!!   qual = quality on a mass basis that follows the REFPROP convention of:
    !!!           q < 0 is a subcooled liquid
    !!!           q = 0 is a saturated liquid
    !!!           q = 1 is a saturated vapor
    !!!           q > 1 is a superheated vapor
    !!!           q = 998 is a superheated vapor with temperature greater than the critical temperature
    !!!           q = 999 is supercritical, with temperature and density/pressure greater than the critical point
    !!!   inte = internal energy (kJ/kg)
    !!!   enth = enthalpy (kJ/kg)
    !!!   entr = entropy (kJ/kg-K)
    !!!   cv = specific heat at constant volume (kJ/kg-K)
    !!!   cp = specific heat at constant pressure (kJ/kg-K)
    !!!   ssnd = speed of sound in the fluid (m/s) 
    !!!   cond = thermal conductivity (W/m-K)
    !!!   visc = viscosity (Pa-s)
    
    ! Required Arguments
    real(dp), intent(in) :: temp, dens
    integer, intent(out) :: error_code

    ! Optional Arguments
    real(dp), intent(out), optional :: pres, vol, qual, inte, enth, entr, cv, cp, ssnd, cond, visc
    
    ! Internal Variables
    type(thermo_obj) :: thermo
    type(thermo_obj), dimension(0:1) :: sat_thermo
    type(sat_obj) :: sat
    logical  :: found_row
    integer  :: row, low, high, first, last, element
    real(sp) :: x
    real(dp) :: quality, inte_liq, enth_liq, entr_liq

    ! Initialize variables and check inputs.
    error_code = 0                  ! initialize error code
    sat%element = -1                ! initialize part of saturation object (used if qual is requested)
    if (temp < T_low_limit) then
        error_code = 201; return
    end if
    if (temp > T_high_limit) then
        error_code = 202; return
    end if    

    ! Determine the starting row.
    row = first_row(temp)
    first = row_info(1,row)  ! first element in this row
    last = row_info(2,row)   ! last element in this row

    ! Find the row containing the density.
    if (dens < elements(3,7,first)) then ! specified density is to the left of this row
        found_row = .false.
        do while (.not. found_row)                                  ! loop over rows until the correct one is found
            row = row_info(3,row)                                   ! reset current row to next row
            if (row == 0) then                                      ! nowhere to go - specified density is too low
                error_code = 203; return
            end if
            first = row_info(1,row)                                 ! reset the first element
            found_row = (dens >= elements(3,7,first))            ! true if the specified density lies within this row
        end do
        last = row_info(2,row)                                      ! reset the last element
    else ! density is in the first row
        if (temp < T_crit) then ! need to check the vapor dome
            call init_sat(temp,row,sat)                             ! initialize the saturation object
            if (dens <= sat%dens(1)) then ! left of dome
                last = sat%element(1)
            else if (dens >= sat%dens(0)) then ! right of dome
                first = sat%element(0)
            else ! in dome - calculate the required properties and return from the subroutine

                quality = (sat%dens(1) * (sat%dens(0) - dens)) / (dens * (sat%dens(0) - sat%dens(1)))           ! based on definition of quality for specific volume, rearranged to reduce divisions
                call init_thermo(sat_thermo,sat%element,[temp,temp])                                            ! initialize the two dome elements
                call eval_using_dens(sat_thermo(0),sat%dens(0),x,inte=inte,enth=enth,entr=entr)                 ! saturated liquid
                if (present(inte)) inte_liq = inte
                if (present(enth)) enth_liq = enth
                if (present(entr)) entr_liq = entr
                call eval_using_dens(sat_thermo(1),sat%dens(1),x,pres=pres,inte=inte,enth=enth,entr=entr)       ! saturated vapor
                if (present(inte)) inte = inte_liq + quality * (inte - inte_liq)
                if (present(enth)) enth = enth_liq + quality * (enth - enth_liq)
                if (present(entr)) entr = entr_liq + quality * (entr - entr_liq)
                if (present(qual)) qual = quality
                if (present(vol))  vol  = 1.0_dp / dens
                if (present(cv)) then
                    cv = -999_dp; error_code = -201
                end if
                if (present(cp)) then
                    cp = -999_dp; error_code = -201
                end if
                if (present(ssnd)) then
                    ssnd = -999_dp; error_code = -201
                end if
                if (present(visc)) then
                    visc = -999_dp; error_code = -201
                end if
                if (present(cond)) then
                    cond = -999_dp; error_code = -201
                end if
                return
            end if
        end if
    end if

    ! Find the element containing the specified density using a binary search.
    low = first
    high = last
    do while (low + 1 < high)
        element = (low + high) / 2                  ! note: integer division
        if (dens < elements(3,7,element)) then   ! given density is to the left of this element
            high = element
        else
            low = element
        end if
    end do
    if (dens >= elements(3,7,high)) then         ! determines if the correct element is 'low' or 'last'
        element = last
    else
        element = low
    end if
    call init_thermo(thermo,element,temp)         ! fully initialize the element
    
    ! Call the appropriate method on the initialized thermo object.
    call eval_using_dens(thermo,dens,x,pres=pres,vol=vol,inte=inte,enth=enth,entr=entr,cv=cv,cp=cp,ssnd=ssnd)
    if (element == last) then
        if (x > 1.0_sp) then  ! specified density is too high
            error_code = 204; return
        end if
    end if

    ! Calculate quality and transport routines if required.
    if (present(qual)) then
        if (temp < T_crit) then
            if (sat%element(0) < 0) call init_sat(temp,first_row(temp),sat)                     ! initialize sat object if it was not already
            qual = (sat%dens(1) * (sat%dens(0) - dens)) / (dens * (sat%dens(0) - sat%dens(1)))  ! based on definition of quality for specific volume, rearranged to reduce divisions
        else
            qual = 999.0_dp
            if (present(pres)) then
                if (pres < P_crit) then
                    qual = 998.0_dp
                end if
            end if
        end if
    end if
    if (present(visc)) visc = viscosity(temp,x,element)
    if (present(cond)) cond = conductivity(temp,x,element)

    return
end subroutine CO2_TD
subroutine CO2_TP(temp,pres,error_code,dens,vol,qual,inte,enth,entr,cv,cp,ssnd,cond,visc)
    !!! Subroutine used to determine fluid properties given temperature and pressure.  An array of inputs can be used if the outputs have a conforming size and shape.
    !!! Required Inputs:
    !!!   temp = temperature (K)
    !!!   pres = pressure (kPa)
    !!! Required Outputs:
    !!!   error_code = an integer error code that can be used with the get_error_message subroutine
    !!! Optional Outputs:
    !!!   dens = density (kg/m3)
    !!!   vol = specific volume (m3/kg)
    !!!   qual = quality on a mass basis that follows the REFPROP convention of:
    !!!           q < 0 is a subcooled liquid
    !!!           q = 0 is a saturated liquid
    !!!           q = 1 is a saturated vapor
    !!!           q > 1 is a superheated vapor
    !!!           q = 998 is a superheated vapor with temperature greater than the critical temperature
    !!!           q = 999 is supercritical, with temperature and density/pressure greater than the critical point
    !!!   inte = internal energy (kJ/kg)
    !!!   enth = enthalpy (kJ/kg)
    !!!   entr = entropy (kJ/kg-K)
    !!!   cv = specific heat at constant volume (kJ/kg-K)
    !!!   cp = specific heat at constant pressure (kJ/kg-K)
    !!!   ssnd = speed of sound in the fluid (m/s) 
    !!!   cond = thermal conductivity (W/m-K)
    !!!   visc = viscosity (Pa-s)
    
    ! Required Arguments
    real(dp), intent(in) :: temp, pres
    integer, intent(out) :: error_code

    ! Optional Arguments
    real(dp), intent(out), optional :: dens, vol, qual, inte, enth, entr, cv, cp, ssnd, cond, visc
    
    ! Internal Variables
    type(thermo_obj) :: thermo
    type(sat_obj) :: sat
    logical  :: found_row
    integer  :: row, low, high, first, last, element
    real(dp) :: sat_pres, dens_internal
    real(sp) :: x

    ! Initialize variables and check inputs.
    error_code = 0                  ! initialize error code
    sat%element = -1                ! initialize part of saturation object (used if qual is requested)
    if (temp < T_low_limit) then
        error_code = 301; return
    end if
    if (temp > T_high_limit) then
        error_code = 302; return
    end if    
    if (pres < P_low_limit) then
        error_code = 303; return
    end if
    if (pres > P_high_limit) then
        error_code = 304; return
    end if

    ! Determine the starting row.
    row = first_row(temp)
    first = row_info(1,row)  ! first element in this row
    last = row_info(2,row)   ! last element in this row

    ! Find the row containing the pressure.
    if (pres < calc_left_pres(first,temp)) then ! specified pressure is to the left of this row
        found_row = .false.
        do while (.not. found_row)                                  ! loop over rows until the correct one is found
            row = row_info(3,row)                                   ! reset current row to next row
            first = row_info(1,row)                                 ! reset the first element
            found_row = (pres >= calc_left_pres(first,temp))  ! true if the specified pressure lies within this row
        end do
        last = row_info(2,row)                                      ! reset the last element
    else ! pressure is in the first row
        if (temp < T_crit) then ! need to check the vapor dome
            call init_sat(temp,row,sat)                          ! initialize the saturation object
            sat_pres = calc_pres(sat%element(1),temp,sat%x(1))   ! calculate the saturation pressure at this temperature
            if (pres > sat_pres) then ! must be to the right of the dome
                first = sat%element(0)
            else if (pres < sat_pres) then ! must be to the left of the dome
                last = sat%element(1)
            else ! temperature and pressure correspond to a saturation (undefined) state
                error_code = 305
                return
            end if
        end if
    end if

    ! Find the element containing the specified pressure using a binary search.
    low = first
    high = last
    do while (low + 1 < high)
        element = (low + high) / 2                          ! note: integer division
        if (pres < calc_left_pres(element,temp)) then ! given pressure is to the left of this element
            high = element
        else
            low = element
        end if
    end do
    if (pres >= calc_left_pres(high,temp)) then       ! determines if the correct element is 'low' or 'last'
        element = last
    else
        element = low
    end if
    call init_thermo(thermo,element,temp)                 ! fully initialize the element
    
    ! Call the appropriate method on the initialized thermo object.
    if (element == sat%element(0)) then
        call eval_using_pres(thermo,pres,x,dens=dens,vol=vol,inte=inte,enth=enth,entr=entr,cv=cv,cp=cp,ssnd=ssnd,low_frac=sat%x(0))
    else if (element == sat%element(1)) then
        call eval_using_pres(thermo,pres,x,dens=dens,vol=vol,inte=inte,enth=enth,entr=entr,cv=cv,cp=cp,ssnd=ssnd,high_frac=sat%x(1))
    else
        call eval_using_pres(thermo,pres,x,dens=dens,vol=vol,inte=inte,enth=enth,entr=entr,cv=cv,cp=cp,ssnd=ssnd)
    end if

    ! Calculate quality and transport routines if required.
    if (present(qual)) then
        if (temp < T_crit) then
            if (sat%element(0) < 0) call init_sat(temp,first_row(temp),sat)  ! initialize sat object if it was not already
            dens_internal = real( thermo%left_D + x / thermo%inv_dD ,dp)
            qual = (sat%dens(1) * (sat%dens(0) - dens_internal)) / (dens_internal * (sat%dens(0) - sat%dens(1)))  ! based on definition of quality for specific volume, rearranged to reduce divisions
        else if (pres < P_crit) then
            qual = 998.0_dp
        else
            qual = 999.0_dp
        end if
    end if
    if (present(visc)) visc = viscosity(temp,x,element)
    if (present(cond)) cond = conductivity(temp,x,element)

    return
end subroutine CO2_TP
subroutine CO2_TQ(temp,qual,error_code,pres,dens,vol,inte,enth,entr,cv,cp,ssnd,cond,visc)
    !!! Subroutine used to determine fluid properties given temperature and quality.  An array of inputs can be used if the outputs have a conforming size and shape.
    !!! Required Inputs:
    !!!   temp = temperature (K)
    !!!   qual = quality on a mass basis
    !!! Required Outputs:
    !!!   error_code = an integer error code that can be used with the get_error_message subroutine
    !!! Optional Outputs:
    !!!   pres = pressure (kPa)
    !!!   dens = density (kg/m3)
    !!!   vol = specific volume (m3/kg)
    !!!   inte = internal energy (kJ/kg)
    !!!   enth = enthalpy (kJ/kg)
    !!!   entr = entropy (kJ/kg-K)
    !!!   cv = specific heat at constant volume (kJ/kg-K)   [only calculated if qual is 0.0 or 1.0]
    !!!   cp = specific heat at constant pressure (kJ/kg-K) [only calculated if qual is 0.0 or 1.0]
    !!!   ssnd = speed of sound in the fluid (m/s)          [only calculated if qual is 0.0 or 1.0]
    !!!   cond = thermal conductivity (W/m-K)               [only calculated if qual is 0.0 or 1.0]
    !!!   visc = viscosity (Pa-s)                           [only calculated if qual is 0.0 or 1.0]

    ! Required Arguments
    real(dp), intent(in) :: temp, qual
    integer, intent(out) :: error_code

    ! Optional Arguments
    real(dp), intent(out), optional :: pres, dens, vol, inte, enth, entr, cv, cp, ssnd, cond, visc

    ! Internal Variables
    type(thermo_obj) :: thermo
    type(thermo_obj), dimension(0:1) :: sat_thermo
    type(sat_obj) :: sat
    integer  :: row
    real(sp) :: x
    real(dp) :: inte_liq, enth_liq, entr_liq

    ! Initialize variables and check inputs.
    error_code = 0                  ! initialize error code
    if (temp < T_sat_min) then
        error_code = 401; return
    end if
    if (temp > T_crit) then
        error_code = 402; return
    end if
    if (qual < 0.0_dp .or. qual > 1.0_dp) then
        error_code = 403; return
    end if
    row = first_row(temp)
    call init_sat(temp,row,sat)      

    ! Check to see if quality is exactly 0.0 or 1.0, and if not use definition of quality and the two saturation states.
    if (qual == 0.0_dp) then ! saturated liquid
        call init_thermo(thermo,sat%element(0),temp)
        call eval_using_dens(thermo,sat%dens(0),x,vol=vol,inte=inte,enth=enth,entr=entr,cv=cv,cp=cp,ssnd=ssnd)
        if (present(dens)) dens = sat%dens(0)
        if (present(visc)) visc = viscosity(temp,x,sat%element(0))
        if (present(cond)) cond = conductivity(temp,x,sat%element(0))
        if (present(pres)) then ! saturated vapor pressure is much more accurate - use it instead
            call init_thermo(thermo,sat%element(1),temp)
            call eval_using_dens(thermo,sat%dens(1),x,pres=pres)
        end if
    else if (qual == 1.0_dp) then                    ! saturated vapor
        call init_thermo(thermo,sat%element(1),temp)
        call eval_using_dens(thermo,sat%dens(1),x,pres=pres,vol=vol,inte=inte,enth=enth,entr=entr,cv=cv,cp=cp,ssnd=ssnd)
        if (present(dens)) dens = sat%dens(1)
        if (present(visc)) visc = viscosity(temp,x,sat%element(1))
        if (present(cond)) cond = conductivity(temp,x,sat%element(1))
    else                                                ! two-phase
        call init_thermo(sat_thermo,sat%element,[temp,temp])                                                 ! initialize the two dome elements
        call eval_using_dens(sat_thermo(0),sat%dens(0),x,inte=inte,enth=enth,entr=entr)                      ! saturated liquid
        if (present(inte)) inte_liq = inte
        if (present(enth)) enth_liq = enth
        if (present(entr)) entr_liq = entr
        call eval_using_dens(sat_thermo(1),sat%dens(1),x,pres=pres,inte=inte,enth=enth,entr=entr)            ! saturated vapor
        if (present(inte)) inte = inte_liq + qual * (inte - inte_liq)
        if (present(enth)) enth = enth_liq + qual * (enth - enth_liq)
        if (present(entr)) entr = entr_liq + qual * (entr - entr_liq)
        if (present(dens)) then
            dens = (sat%dens(1) * sat%dens(0)) / (qual * (sat%dens(0) - sat%dens(1)) + sat%dens(1))  ! based on definition of quality for volume, rearranged to reduce divisions
            if (present(vol)) vol = 1.0_dp / dens
        else if (present(vol)) then
            vol = (qual * (sat%dens(0) - sat%dens(1)) + sat%dens(1)) /  (sat%dens(1) * sat%dens(0))
        end if
        if (present(cv)) then
            cv = -999_dp; error_code = -401
        end if
        if (present(cp)) then
            cp = -999_dp; error_code = -401
        end if
        if (present(ssnd)) then
            ssnd = -999_dp; error_code = -401
        end if
        if (present(visc)) then
            visc = -999_dp; error_code = -401
        end if
        if (present(cond)) then
            cond = -999_dp; error_code = -401
        end if
    end if

    return
end subroutine CO2_TQ
subroutine CO2_PQ(pres,qual,error_code,temp,dens,vol,inte,enth,entr,cv,cp,ssnd,cond,visc)
    !!! Subroutine used to determine fluid properties given pressure and quality.  An array of inputs can be used if the outputs have a conforming size and shape.
    !!! Required Inputs:
    !!!   pres = pressure (kPa)
    !!!   qual = quality on a mass basis
    !!! Required Outputs:
    !!!   error_code = an integer error code that can be used with the get_error_message subroutine
    !!! Optional Outputs:
    !!!   temp = temperature (K)
    !!!   dens = density (kg/m3)
    !!!   vol = specific volume (m3/kg)
    !!!   inte = internal energy (kJ/kg)
    !!!   enth = enthalpy (kJ/kg)
    !!!   entr = entropy (kJ/kg-K)
    !!!   cv = specific heat at constant volume (kJ/kg-K)   [only calculated if qual is 0.0 or 1.0]
    !!!   cp = specific heat at constant pressure (kJ/kg-K) [only calculated if qual is 0.0 or 1.0]
    !!!   ssnd = speed of sound in the fluid (m/s)          [only calculated if qual is 0.0 or 1.0]
    !!!   cond = thermal conductivity (W/m-K)               [only calculated if qual is 0.0 or 1.0]
    !!!   visc = viscosity (Pa-s)                           [only calculated if qual is 0.0 or 1.0]

    ! Required Arguments
    real(dp), intent(in) :: pres, qual
    integer, intent(out) :: error_code

    ! Optional Arguments
    real(dp), intent(out), optional :: temp, dens, vol, inte, enth, entr, cv, cp, ssnd, cond, visc

    ! Internal Variables
    type(thermo_obj) :: thermo
    type(thermo_obj), dimension(0:1) :: sat_thermo
    type(sat_obj) :: sat
    integer  :: row
    real(sp) :: x
    real(dp) :: inte_liq, enth_liq, entr_liq, sat_temp

    ! Initialize variables and check inputs.
    error_code = 0                  ! initialize error code
    if (pres < P_sat_min) then
        error_code = 501; return
    end if
    if (pres > P_crit) then
        error_code = 502; return
    end if
    if (qual < 0.0_dp .or. qual > 1.0_dp) then
        error_code = 503; return
    end if
    sat_temp = calculate_sat_temp(pres)
    row = first_row(sat_temp)
    call init_sat(sat_temp,row,sat)

    ! Check to see if quality is exactly 0.0 or 1.0, and if not use definition of quality and the two saturation states.
    if (qual == 0.0_dp) then  ! saturated liquid
        call init_thermo(thermo,sat%element(0),sat_temp)
        call eval_using_dens(thermo,sat%dens(0),x,vol=vol,inte=inte,enth=enth,entr=entr,cv=cv,cp=cp,ssnd=ssnd)
        if (present(temp)) temp = sat_temp
        if (present(dens)) dens = sat%dens(0)
        if (present(visc)) visc = viscosity(sat_temp,x,sat%element(0))
        if (present(cond)) cond = conductivity(sat_temp,x,sat%element(0))
    else if (qual == 1.0_dp) then  ! saturated vapor
        call init_thermo(thermo,sat%element(1),sat_temp)
        call eval_using_dens(thermo,sat%dens(1),x,vol=vol,inte=inte,enth=enth,entr=entr,cv=cv,cp=cp,ssnd=ssnd)
        if (present(temp)) temp = sat_temp
        if (present(dens)) dens = sat%dens(1)
        if (present(visc)) visc = viscosity(sat_temp,x,sat%element(1))
        if (present(cond)) cond = conductivity(sat_temp,x,sat%element(1))
    else  ! two-phase
        call init_thermo(sat_thermo,sat%element,[sat_temp,sat_temp])                                ! initialize the two dome elements
        call eval_using_dens(sat_thermo(0),sat%dens(0),x,inte=inte,enth=enth,entr=entr)             ! saturated liquid
        if (present(inte)) inte_liq = inte
        if (present(enth)) enth_liq = enth
        if (present(entr)) entr_liq = entr
        call eval_using_dens(sat_thermo(1),sat%dens(1),x,inte=inte,enth=enth,entr=entr)             ! saturated vapor
        if (present(inte)) inte = inte_liq + qual * (inte - inte_liq)
        if (present(enth)) enth = enth_liq + qual * (enth - enth_liq)
        if (present(entr)) entr = entr_liq + qual * (entr - entr_liq)
        if (present(temp)) temp = sat_temp
        if (present(dens)) then
            dens = (sat%dens(1) * sat%dens(0)) / (qual * (sat%dens(0) - sat%dens(1)) + sat%dens(1)) ! based on definition of quality for volume, rearranged to reduce divisions
            if (present(vol)) vol = 1.0_dp / dens
        else if (present(vol)) then
            vol = (qual * (sat%dens(0) - sat%dens(1)) + sat%dens(1)) /  (sat%dens(1) * sat%dens(0))
        end if
        if (present(cv)) then
            cv = -999_dp; error_code = -501
        end if
        if (present(cp)) then
            cp = -999_dp; error_code = -501
        end if
        if (present(ssnd)) then
            ssnd = -999_dp; error_code = -501
        end if
        if (present(visc)) then
            visc = -999_dp; error_code = -501
        end if
        if (present(cond)) then
            cond = -999_dp; error_code = -501
        end if
    end if

    return
end subroutine CO2_PQ
subroutine CO2_PH(pres,enth,error_code,temp,dens,vol,qual,inte,entr,cv,cp,ssnd,cond,visc)
    !!! Subroutine used to determine fluid properties given pressure and enthalpy.  An array of inputs can be used if the outputs have a conforming size and shape.
    !!! Required Inputs:
    !!!   pres = pressure (kPa)
    !!!   enth = enthalpy (kJ/kg)
    !!! Required Outputs:
    !!!   error_code = an integer error code that can be used with the get_error_message subroutine
    !!! Optional Outputs:
    !!!   temp = temperature (K)
    !!!   dens = density (kg/m3)
    !!!   vol = specific volume (m3/kg)
    !!!   qual = quality on a mass basis that follows the REFPROP convention of:
    !!!           q < 0 is a subcooled liquid
    !!!           q = 0 is a saturated liquid
    !!!           q = 1 is a saturated vapor
    !!!           q > 1 is a superheated vapor
    !!!           q = 998 is a superheated vapor with temperature greater than the critical temperature
    !!!           q = 999 is supercritical, with temperature and density/pressure greater than the critical point
    !!!   inte = internal energy (kJ/kg)
    !!!   entr = entropy (kJ/kg-K)
    !!!   cv = specific heat at constant volume (kJ/kg-K)
    !!!   cp = specific heat at constant pressure (kJ/kg-K)
    !!!   ssnd = speed of sound in the fluid (m/s) 
    !!!   cond = thermal conductivity (W/m-K)
    !!!   visc = viscosity (Pa-s)
    
    ! Required Arguments
    real(dp), intent(in) :: pres, enth
    integer, intent(out) :: error_code

    ! Optional Arguments
    real(dp), intent(out), optional :: temp, dens, vol, qual, inte, entr, cv, cp, ssnd, cond, visc
    
    ! Parameters
    real(dp), parameter :: rel_zero_tol = 1e-4_dp

    ! Internal Variables
    type(thermo_obj) :: thermo
    type(thermo_obj), dimension(0:1) :: sat_thermo
    type(sat_obj) :: sat
    logical  :: liquid
    integer  :: row, iter, element, quick_error
    real(sp) :: x
    real(dp) :: dens_internal, T_low, T_mid, T_high, T_guess, sat_temp, enth_liq, enth_vap, enth_low_norm, enth_mid_norm, enth_high_norm, enth_norm
    real(dp) :: inte_liq, entr_liq, quality, D_BDQRF, a_BDQRF, b_BDQRF, scaled_zero_tol

    ! Initialize variables and check inputs.
    error_code = 0                          ! initialize error code
    scaled_zero_tol = rel_zero_tol * enth   ! for temperature convergence
    T_low = T_low_limit                     ! lowest possible temperature to check
    T_high = T_high_limit                   ! highest possible temperature to check
    if (pres < P_low_limit) then
        error_code = 601; return
    end if
    if (pres > P_high_limit) then
        error_code = 602; return
    end if

    ! Use the specified pressure to narrow down search region.
    if (pres < P_sat_min) then ! state must be vapor or supercritical
        
        liquid = .false.
        call quick_prop(T_low_limit,pres,3,liquid,element,x,enth_low_norm,quick_error)  ! lower enthalpy residual
        if (quick_error > 0) then
            error_code = 1
            return
        end if
        enth_low_norm = enth_low_norm - enth
        if (enth_low_norm > 0.0_sp) then
            error_code = 603  ! enthalpy is too low for the given pressure
            return
        end if
        call quick_prop(T_high_limit,pres,3,liquid,element,x,enth_high_norm,quick_error)  ! upper enthalpy residual
        if (quick_error > 0) then
            error_code = 1
            return
        end if
        enth_high_norm = enth_high_norm - enth
        if (enth_high_norm < 0.0_sp) then
            error_code = 604  ! enthalpy is too high for the given pressure
            return
        end if

    else if (pres < P_crit) then ! state could be two-phase

        ! For the given pressure, calculate the corresponding saturation temperature and enthalpies.
        sat_temp = calculate_sat_temp(pres)
        row = first_row(sat_temp)
        call init_sat(sat_temp,row,sat)
        call init_thermo(sat_thermo,sat%element,[sat_temp,sat_temp])                             ! initialize the two dome elements
        call eval_using_dens(sat_thermo(0),sat%dens(0),x,enth=enth_liq,inte=inte,entr=entr)      ! saturated liquid
        if (present(inte)) inte_liq = inte
        if (present(entr)) entr_liq = entr
        call eval_using_dens(sat_thermo(1),sat%dens(1),x,enth=enth_vap,inte=inte,entr=entr)      ! saturated vapor

        ! Determine where the specified enthalpy is relative to the saturation conditions.
        if (enth > enth_vap) then ! state must be vapor or supercritical
            liquid = .false.
            T_low = sat_temp                    ! reset the lower bound for the possible temperature range
            enth_low_norm = enth_vap - enth     ! lower enthalpy residual
            call quick_prop(T_high_limit-1_dp,pres,3,liquid,element,x,enth_high_norm,quick_error)  ! upper enthalpy residual
            if (quick_error > 0) then
                error_code = 1
                return
            end if
            enth_high_norm = enth_high_norm - enth
            if (enth_high_norm < 0.0_sp) then
                error_code = 604  ! enthalpy is too high for the given pressure
                return
            end if
        else if (enth < enth_liq) then ! state must be liquid
            liquid = .true.
            T_high = sat_temp                    ! reset the upper bound for the possible temperature range
            enth_high_norm = enth_liq - enth     ! upper enthalpy residual
            call quick_prop(T_low_limit+0.1_dp,pres,3,liquid,element,x,enth_low_norm,quick_error)  ! lower enthalpy residual
            if (quick_error > 0) then
                error_code = 1
                return
            end if
            enth_low_norm = enth_low_norm - enth
            if (enth_low_norm > 0.0_sp) then
                error_code = 603  ! enthalpy is too low for the given pressure
                return
            end if
        else  ! the specified pressure and enthalpy are within the vapor dome
            quality = (enth - enth_liq) / (enth_vap - enth_liq)
            if (quality == 0.0_dp) then ! saturated liquid
                call eval_using_dens(sat_thermo(0),sat%dens(0),x,vol=vol,inte=inte,entr=entr,cv=cv,cp=cp,ssnd=ssnd)  ! initialize again, but unlikely this will every happen
                if (present(dens)) dens = real(sat%dens(0),dp)
                if (present(visc)) visc = viscosity(sat_temp,x,sat%element(0))
                if (present(cond)) cond = conductivity(sat_temp,x,sat%element(0))
            else if (quality == 1.0_dp) then ! saturated vapor
                call eval_using_dens(sat_thermo(1),sat%dens(1),x,vol=vol,inte=inte,entr=entr,cv=cv,cp=cp,ssnd=ssnd)  ! initialize again, but unlikely this will every happen            
                if (present(dens)) dens = real(sat%dens(1),dp)
                if (present(visc)) visc = viscosity(sat_temp,x,sat%element(1))
                if (present(cond)) cond = conductivity(sat_temp,x,sat%element(1))
            else  ! two-phase
                if (present(inte)) inte = inte_liq + quality * (inte - inte_liq)
                if (present(entr)) entr = entr_liq + quality * (entr - entr_liq)
                if (present(dens)) then
                    dens = real( (sat%dens(1) * sat%dens(0)) / (real(quality,sp) * (sat%dens(0) - sat%dens(1)) + sat%dens(1)) ,dp)  ! based on definition of quality for volume, rearranged to reduce divisions
                    if (present(vol)) vol = 1.0_dp / dens
                else if (present(vol)) then
                    vol = real( (real(quality,sp) * (sat%dens(0) - sat%dens(1)) + sat%dens(1)) /  (sat%dens(1) * sat%dens(0)) ,dp)
                end if
                if (present(cv)) then
                    cv = -999_dp; error_code = -601
                end if
                if (present(cp)) then
                    cp = -999_dp; error_code = -601
                end if
                if (present(ssnd)) then
                    ssnd = -999_dp; error_code = -601
                end if
                if (present(visc)) then
                    visc = -999_dp; error_code = -601
                end if
                if (present(cond)) then
                    cond = -999_dp; error_code = -601
                end if
            end if
            if (present(temp)) temp = sat_temp
            if (present(qual)) qual = quality
            return
        end if    

    else ! state must be supercritical or liquid

        liquid = .true.
        call quick_prop(T_low_limit,pres,3,liquid,element,x,enth_low_norm,quick_error)  ! lower enthalpy residual
        if (quick_error > 0) then
            error_code = 1
            return
        end if
        enth_low_norm = enth_low_norm - enth
        if (enth_low_norm > 0.0_sp) then
            error_code = 603  ! enthalpy is too low for the given pressure
            return
        end if
        !enth_high_norm = enth_from_temp_and_pres(temp=T_high_limit,pres=pres,liquid=.true.)  ! upper enthalpy residual
        call quick_prop(T_high_limit,pres,3,liquid,element,x,enth_high_norm,quick_error)  ! upper enthalpy residual
        if (quick_error > 0) then
            error_code = 1
            return
        end if
        enth_high_norm = enth_high_norm - enth
        if (enth_high_norm < 0.0_sp) then
            error_code = 604  ! enthalpy is too high for the given pressure
            return
        end if

    end if

    ! Find the correct temperature for the given pressure and enthalpy using the BDQRF method.
    BDQRF: do iter = 1,51
        T_mid = (T_high + T_low) * 0.5_dp
        call quick_prop(T_mid,pres,3,liquid,element,x,enth_mid_norm,quick_error)  ! midpoint enthalpy residual
        enth_mid_norm = enth_mid_norm - enth
        D_BDQRF = (T_high - T_low) * 0.5_dp
        a_BDQRF = (enth_high_norm + enth_low_norm - 2.0_dp * enth_mid_norm) / (2.0_dp * D_BDQRF**2)
        b_BDQRF = (enth_high_norm - enth_low_norm) / (2.0_dp * D_BDQRF)
        T_guess = T_mid - 2.0_dp * enth_mid_norm / (b_BDQRF * (1.0_dp + sqrt(1.0_dp - 4.0_dp * a_BDQRF * enth_mid_norm / b_BDQRF**2)))
	if (T_guess /= T_guess) then
		T_guess = T_mid
	end if        
	call quick_prop(T_guess,pres,3,liquid,element,x,enth_norm,quick_error)  ! enthalpy residual
        enth_norm = enth_norm - enth
        if (enth_norm > 0.0_dp) then
            if (enth_norm <= scaled_zero_tol) exit BDQRF
            T_high = T_guess
            enth_high_norm = enth_norm
            if (enth_mid_norm < 0) then
                T_low = T_mid
                enth_low_norm = enth_mid_norm
            end if
        else
            if (-enth_norm <= scaled_zero_tol) exit BDQRF
            T_low = T_guess
            enth_low_norm = enth_norm
            if (enth_mid_norm > 0) then
                T_high = T_mid
                enth_high_norm = enth_mid_norm
            end if
        end if
    end do BDQRF

    ! Check that the loop was successful.
    if (iter >= 50) then
	!print *,'Warning: PH did not converge to tolerance:'
	!print *,'      ','Temp Guess:',T_guess,'Specified Pres:',pres,'Specified Enth:',enth,'Calculated Enth:',enth_norm+enth
        !error_code = 605
        !return
    end if

    ! Fully evaluate the element.
    call init_thermo(thermo,element,T_guess)
    call eval_using_x(thermo,x,dens=dens,vol=vol,inte=inte,entr=entr,cv=cv,cp=cp,ssnd=ssnd)
    if (present(temp)) temp = T_guess

    ! Calculate quality and transport routines if required.
    if (present(qual)) then
        if (T_guess < T_crit) then
            call init_sat(T_guess,first_row(T_guess),sat)  ! initialize sat object
            dens_internal = thermo%left_D + x / thermo%inv_dD
            qual = (sat%dens(1) * (sat%dens(0) - dens_internal)) / (dens_internal * (sat%dens(0) - sat%dens(1)))  ! based on definition of quality for specific volume, rearranged to reduce divisions
        else if (pres < P_crit) then
            qual = 998.0_sp
        else
            qual = 999.0_sp
        end if
    end if
    if (present(visc)) visc = viscosity(T_guess,x,element)
    if (present(cond)) cond = conductivity(T_guess,x,element)

    return
end subroutine CO2_PH
subroutine CO2_PS(pres,entr,error_code,temp,dens,vol,qual,inte,enth,cv,cp,ssnd,cond,visc)
    !!! Subroutine used to determine fluid properties given pressure and entropy.  An array of inputs can be used if the outputs have a conforming size and shape.
