                end if
                if (present(cv)) then
                    cv = -999_dp; error_code = -701
                end if
                if (present(cp)) then
                    cp = -999_dp; error_code = -701
                end if
                if (present(ssnd)) then
                    ssnd = -999_dp; error_code = -701
                end if
                if (present(visc)) then
                    visc = -999_dp; error_code = -701
                end if
                if (present(cond)) then
                    cond = -999_dp; error_code = -701
                end if
            end if
            if (present(temp)) temp = sat_temp
            if (present(qual)) qual = quality
            return
        end if    

    else ! state must be supercritical or liquid

        liquid = .true.
        call quick_prop(T_low_limit,pres,2,liquid,element,x,entr_low_norm,quick_error)  ! lower entropy residual
        if (quick_error > 0) then
            error_code = 1
            return
        end if
        entr_low_norm = entr_low_norm - entr
        if (entr_low_norm > 0.0_sp) then
            error_code = 703  ! entropy is too low for the given pressure
            return
        end if
        call quick_prop(T_high_limit,pres,2,liquid,element,x,entr_high_norm,quick_error)  ! upper entropy residual
        if (quick_error > 0) then
            error_code = 1
            return
        end if
        entr_high_norm = entr_high_norm - entr
        if (entr_high_norm < 0.0_sp) then
            error_code = 704  ! entropy is too high for the given pressure
            return
        end if

    end if

    ! Find the correct temperature for the given pressure and entropy using the BDQRF method.
    BDQRF: do iter = 1,51
        T_mid = (T_high + T_low) * 0.5_dp
        call quick_prop(T_mid,pres,2,liquid,element,x,entr_mid_norm,quick_error)  ! midpoint entropy residual
        entr_mid_norm = entr_mid_norm - entr
        D_BDQRF = (T_high - T_low) * 0.5_dp
        a_BDQRF = (entr_high_norm + entr_low_norm - 2.0_dp * entr_mid_norm) / (2.0_dp * D_BDQRF**2)
        b_BDQRF = (entr_high_norm - entr_low_norm) / (2.0_dp * D_BDQRF)
        T_guess = T_mid - 2.0_dp * entr_mid_norm / (b_BDQRF * (1.0_dp + sqrt(1.0_dp - 4.0_dp * a_BDQRF * entr_mid_norm / b_BDQRF**2)))
        call quick_prop(T_guess,pres,2,liquid,element,x,entr_norm,quick_error)  ! entropy residual
        entr_norm = entr_norm - entr
        if (entr_norm > 0.0_dp) then
            if (entr_norm <= scaled_zero_tol) exit BDQRF
            T_high = T_guess
            entr_high_norm = entr_norm
            if (entr_mid_norm < 0) then
                T_low = T_mid
                entr_low_norm = entr_mid_norm
            end if
        else
            if (-entr_norm <= scaled_zero_tol) exit BDQRF
            T_low = T_guess
            entr_low_norm = entr_norm
            if (entr_mid_norm > 0) then
                T_high = T_mid
                entr_high_norm = entr_mid_norm
            end if
        end if
    end do BDQRF

    ! Check that the loop was successful.
    if (iter >= 50) then
        error_code = 705
        return
    end if

    ! Fully evaluate the element.
    call init_thermo(thermo,element,T_guess)
    call eval_using_x(thermo,x,dens=dens,vol=vol,inte=inte,enth=enth,cv=cv,cp=cp,ssnd=ssnd)
    if (present(temp)) temp = T_guess

    ! Calculate quality and transport routines if required.
    if (present(qual)) then
        if (T_guess < T_crit) then
            call init_sat(T_guess,first_row(T_guess),sat)  ! initialize sat object
            dens_internal = thermo%left_D + x / thermo%inv_dD
            qual = (sat%dens(1) * (sat%dens(0) - dens_internal)) / (dens_internal * (sat%dens(0) - sat%dens(1)))  ! based on definition of quality for specific volume, rearranged to reduce divisions
        else if (pres < P_crit) then
            qual = 998.0_sp
        else
            qual = 999.0_sp
        end if
    end if
    if (present(visc)) visc = viscosity(T_guess,x,element)
    if (present(cond)) cond = conductivity(T_guess,x,element)

    return
end subroutine CO2_PS
subroutine CO2_TS(temp,entr,error_code,pres,dens,vol,qual,inte,enth,cv,cp,ssnd,cond,visc)
    !!! Subroutine used to determine fluid properties given temperature and entropy.  An array of inputs can be used if the outputs have a conforming size and shape.
    !!! Required Inputs:
    !!!   temp = temperature (K)
    !!!   entr = entropy (kJ/kg-K)
    !!! Required Outputs:
    !!!   error_code = an integer error code that can be used with the get_error_message subroutine
    !!! Optional Outputs:
    !!!   pres = pressure (kPa)
    !!!   dens = density (kg/m3)
    !!!   vol = specific volume (m3/kg)
    !!!   qual = quality on a mass basis that follows the REFPROP convention of:
    !!!           q < 0 is a subcooled liquid
    !!!           q = 0 is a saturated liquid
    !!!           q = 1 is a saturated vapor
    !!!           q > 1 is a superheated vapor
    !!!           q = 998 is a superheated vapor with temperature greater than the critical temperature
    !!!           q = 999 is supercritical, with temperature and density/pressure greater than the critical point
    !!!   inte = internal energy (kJ/kg)
    !!!   enth = enthalpy (kJ/kg)
    !!!   cv = specific heat at constant volume (kJ/kg-K)
    !!!   cp = specific heat at constant pressure (kJ/kg-K)
    !!!   ssnd = speed of sound in the fluid (m/s) 
    !!!   cond = thermal conductivity (W/m-K)
    !!!   visc = viscosity (Pa-s)
    
    ! Required Arguments
    real(dp), intent(in) :: temp, entr
    integer, intent(out) :: error_code

    ! Optional Arguments
    real(dp), intent(out), optional :: pres, dens, vol, qual, inte, enth, cv, cp, ssnd, cond, visc
    
    ! Internal Variables
    type(thermo_obj) :: thermo
    type(thermo_obj), dimension(0:1) :: sat_thermo
    type(sat_obj) :: sat
    logical  :: found_row
    integer  :: row, low, high, first, last, element
    real(sp) :: x
    real(dp) :: quality, inte_liq, enth_liq, entr_vap, entr_liq

    ! Initialize variables and check inputs.
    error_code = 0                  ! initialize error code
    sat%element = -1                ! initialize part of saturation object (used if qual is requested)
    if (temp < T_low_limit) then
        error_code = 801; return
    end if
    if (temp > T_high_limit) then
        error_code = 802; return
    end if    

    ! Determine the starting row.
    row = first_row(temp)
    first = row_info(1,row)  ! first element in this row
    last = row_info(2,row)   ! last element in this row

    ! Find the row containing the entropy.
    if (entr > calc_left_entr(first,temp)) then ! specified entropy is to the left of this row
        found_row = .false.
        do while (.not. found_row)                                  ! loop over rows until the correct one is found
            row = row_info(3,row)                                   ! reset current row to next row
            if (row == 0) then                                       ! nowhere to go - specified entropy is too low
                error_code = 803; return
            end if
            first = row_info(1,row)                                 ! reset the first element
            found_row = (entr <= calc_left_entr(first,temp))            ! true if the specified entropy lies within this row
        end do
        last = row_info(2,row)                                      ! reset the last element
    else ! density is in the first row
        if (temp < T_crit) then ! need to check the vapor dome
            call init_sat(temp,row,sat)                          ! initialize the saturation object
            call init_thermo(sat_thermo,sat%element,[temp,temp])   ! initialize the two dome elements
            call eval_using_dens(sat_thermo(0),sat%dens(0),x,inte=inte,enth=enth,entr=entr_liq)      ! saturated liquid
            if (present(inte)) inte_liq = inte
            if (present(enth)) enth_liq = enth
            call eval_using_dens(sat_thermo(1),sat%dens(1),x,inte=inte,enth=enth,entr=entr_vap,pres=pres)      ! saturated vapor
            if (entr >= entr_vap) then ! left of dome
                last = sat%element(1)
            else if (entr <= entr_liq) then ! right of dome
                first = sat%element(0)
            else ! in dome - calculate the required properties and return from the subroutine
                quality = (entr - entr_liq) / (entr_vap - entr_liq)
                if (present(inte)) inte = inte_liq + quality * (inte - inte_liq)
                if (present(enth)) enth = enth_liq + quality * (enth - enth_liq)
                if (present(qual)) qual = quality
                if (present(dens)) then
                    dens = (sat%dens(1) * sat%dens(0)) / (quality * (sat%dens(0) - sat%dens(1)) + sat%dens(1))  ! based on definition of quality for volume, rearranged to reduce divisions
                    if (present(vol)) vol = 1.0_dp / dens
                else if (present(vol)) then
                    vol = (quality * (sat%dens(0) - sat%dens(1)) + sat%dens(1)) /  (sat%dens(1) * sat%dens(0))
                end if                
                if (present(cv)) then
                    cv = -999_dp; error_code = -801
                end if
                if (present(cp)) then
                    cp = -999_dp; error_code = -801
                end if
                if (present(ssnd)) then
                    ssnd = -999_dp; error_code = -801
                end if
                if (present(visc)) then
                    visc = -999_dp; error_code = -801
                end if
                if (present(cond)) then
                    cond = -999_dp; error_code = -801
                end if
                return
            end if
        end if
    end if

    ! Find the element containing the specified density using a binary search.
    low = first
    high = last
    do while (low + 1 < high)
        element = (low + high) / 2                  ! note: integer division
        if (entr > calc_left_entr(element,temp)) then   ! given density is to the left of this element
            high = element
        else
            low = element
        end if
    end do
    if (entr <= calc_left_entr(high,temp)) then         ! determines if the correct element is 'low' or 'last'
        element = last
    else
        element = low
    end if
    call init_thermo(thermo,element,temp)         ! fully initialize the element
    
    ! Call the appropriate method on the initialized thermo object.
    call eval_using_entr(thermo,entr,x,pres=pres,dens=dens,vol=vol,inte=inte,enth=enth,cv=cv,cp=cp,ssnd=ssnd)
    if (element == last) then
        if (x > 1.0_sp) then                                       ! specified entropy is too high
            error_code = 804; return
        end if
    end if

    ! Calculate quality and transport routines if required.
    if (present(qual)) then
        if (temp < T_crit) then
            if (sat%element(0) < 0) then
                call init_sat(temp,first_row(temp),sat)                          ! initialize the saturation object
                call init_thermo(sat_thermo,sat%element,[temp,temp])   ! initialize the two dome elements
                call eval_using_dens(sat_thermo(0),sat%dens(0),x,entr=entr_liq)      ! saturated liquid
                call eval_using_dens(sat_thermo(1),sat%dens(1),x,entr=entr_vap)      ! saturated vapor
            end if
            qual = (entr - entr_liq) / (entr_vap - entr_liq)
        else
            qual = 999.0_dp
            if (present(pres)) then
                if (pres < P_crit) then
                    qual = 998.0_dp
                end if
            end if
        end if
    end if
    if (present(visc)) visc = viscosity(temp,x,element)
    if (present(cond)) cond = conductivity(temp,x,element)

    return
end subroutine CO2_TS
subroutine CO2_HS(enth,entr,error_code,temp,pres,dens,vol,qual,inte,cv,cp,ssnd,cond,visc)
    !!! Subroutine used to determine fluid properties given enthalpy and entropy.  An array of inputs can be used if the outputs have a conforming size and shape.
    !!! Required Inputs:
    !!!   enth = enthalpy (kJ/kg)
    !!!   entr = entropy (kJ/kg-K)
    !!! Required Outputs:
    !!!   error_code = an integer error code that can be used with the get_error_message subroutine
    !!! Optional Outputs:
    !!!   temp = temperature (K)
    !!!   pres = pressure (kPa)
    !!!   dens = density (kg/m3)
    !!!   vol = specific volume (m3/kg)
    !!!   qual = quality on a mass basis that follows the REFPROP convention of:
    !!!           q < 0 is a subcooled liquid
    !!!           q = 0 is a saturated liquid
    !!!           q = 1 is a saturated vapor
    !!!           q > 1 is a superheated vapor
    !!!           q = 998 is a superheated vapor with temperature greater than the critical temperature
    !!!           q = 999 is supercritical, with temperature and density/pressure greater than the critical point
    !!!   inte = internal energy (kJ/kg)
    !!!   cv = specific heat at constant volume (kJ/kg-K)
    !!!   cp = specific heat at constant pressure (kJ/kg-K)
    !!!   ssnd = speed of sound in the fluid (m/s) 
    !!!   cond = thermal conductivity (W/m-K)
    !!!   visc = viscosity (Pa-s)
    
    ! Required Arguments
    real(dp), intent(in) :: enth, entr
    integer, intent(out) :: error_code

    ! Optional Arguments
    real(dp), intent(out), optional :: temp, pres, dens, vol, qual, inte, cv, cp, ssnd, cond, visc
    
    ! Parameters
    real(dp), parameter :: rel_zero_tol = 1e-5_dp

    ! Internal Variables
    type(sat_obj) :: sat
    integer  :: iter, TS_error_code
    real(dp) :: T_low, T_high, T_guess, enth_guess
    real(dp) :: scaled_zero_tol
    real(dp) :: dens_internal

    ! Initialize variables and check inputs.
    error_code = 0                          ! initialize error code
    scaled_zero_tol = rel_zero_tol * enth   ! for temperature convergence
    T_low = T_low_limit                     ! lowest possible temperature to check
    T_high = T_high_limit                   ! highest possible temperature to check

    ! Check limits - need to add error checking below for out-of-bounds inputs.

    ! Find the correct temperature for the given density and entropy using a bisection method.
    ! The TS call in the loop could be optimized to a more specific version.
    ! Also could implement as a secant search, checking for bad boundaries.
    bisect: do iter = 1,51
        if (T_high - T_low < 0.0001_dp) exit bisect
        T_guess = (T_high + T_low) * 0.5_dp
        call CO2_TS(T_guess,entr,TS_error_code,enth=enth_guess)  ! midpoint entropy residual
        if (TS_error_code == 803) then  ! entropy is too small for given temperature; guess must be too low
            T_low = T_guess
        else if (TS_error_code == 804) then  ! entropy is too large for given temperature; guess must be too high
            T_high = T_guess
        else
            if (enth_guess < enth) then  ! temperature is too low
                T_low = T_guess
                if (enth-enth_guess <= scaled_zero_tol) exit bisect
            else
                if (enth_guess-enth <= scaled_zero_tol) exit bisect
                T_high = T_guess
            end if
        end if
    end do bisect

    ! Check that the loop was successful.
    if (iter >= 50) then
        error_code = 905
        return
    end if

    ! Fully evaluate the element (this could be optimized).
    call CO2_TS(T_guess,entr,TS_error_code,pres=pres,dens=dens_internal,vol=vol,inte=inte,cv=cv,cp=cp,ssnd=ssnd,cond=cond,visc=visc)
    if (present(dens)) dens = dens_internal
    if (TS_error_code == -801) error_code = -901
    if (TS_error_code > 0) error_code = 9999  ! default error code
    if (present(temp)) temp = T_guess

    ! Calculate quality if required.
    if (present(qual)) then
        if (T_guess < T_crit) then
            call init_sat(T_guess,first_row(T_guess),sat)  ! initialize sat object
            qual = (sat%dens(1) * (sat%dens(0) - dens_internal)) / (dens_internal * (sat%dens(0) - sat%dens(1)))  ! based on definition of quality for specific volume, rearranged to reduce divisions
        else 
            qual = 999.0_sp  ! does not check for superheated vapor state
        end if
    end if

    return
end subroutine CO2_HS
subroutine CO2_DS(dens,entr,error_code,temp,pres,vol,qual,inte,enth,cv,cp,ssnd,cond,visc)
    !!! Subroutine used to determine fluid properties given density and entropy.  An array of inputs can be used if the outputs have a conforming size and shape.
    !!! Required Inputs:
    !!!   dens = density (kg/m3)
    !!!   entr = entropy (kJ/kg-K)
    !!! Required Outputs:
    !!!   error_code = an integer error code that can be used with the get_error_message subroutine
    !!! Optional Outputs:
    !!!   temp = temperature (K)
    !!!   pres = pressure (kPa)
    !!!   vol = specific volume (m3/kg)
    !!!   qual = quality on a mass basis that follows the REFPROP convention of:
    !!!           q < 0 is a subcooled liquid
    !!!           q = 0 is a saturated liquid
    !!!           q = 1 is a saturated vapor
    !!!           q > 1 is a superheated vapor
    !!!           q = 998 is a superheated vapor with temperature greater than the critical temperature
    !!!           q = 999 is supercritical, with temperature and density/pressure greater than the critical point
    !!!   inte = internal energy (kJ/kg)
    !!!   enth = enthalpy (kJ/kg)
    !!!   cv = specific heat at constant volume (kJ/kg-K)
    !!!   cp = specific heat at constant pressure (kJ/kg-K)
    !!!   ssnd = speed of sound in the fluid (m/s) 
    !!!   cond = thermal conductivity (W/m-K)
    !!!   visc = viscosity (Pa-s)
    
    ! Required Arguments
    real(dp), intent(in) :: dens, entr
    integer, intent(out) :: error_code

    ! Optional Arguments
    real(dp), intent(out), optional :: temp, pres, vol, qual, inte, enth, cv, cp, ssnd, cond, visc
    
    ! Parameters
    real(dp), parameter :: rel_zero_tol = 1e-6_dp

    ! Internal Variables
    type(sat_obj) :: sat
    integer  :: iter, TD_error_code
    real(dp) :: T_low, T_high, T_guess, entr_guess, scaled_zero_tol

    ! Initialize variables and check inputs.
    error_code = 0                          ! initialize error code
    scaled_zero_tol = rel_zero_tol * entr   ! for temperature convergence
    T_low = T_low_limit                     ! lowest possible temperature to check
    T_high = T_high_limit                   ! highest possible temperature to check

    ! Check limits - need to add error checking below for out-of-bounds inputs.
    ! Find the correct temperature for the given density and entropy using a bisection method
    ! The TD call in the loop could be optimized to a more specific version.
    ! Also could use a secant search instead.
    bisect: do iter = 1,51
        T_guess = (T_high + T_low) * 0.5_dp
        call CO2_TD(T_guess,dens,TD_error_code,entr=entr_guess)  ! midpoint entropy residual
        if (TD_error_code == 203) then  ! density is too small for given temperature; guess must be too low
            T_low = T_guess
        else if (TD_error_code == 204) then  ! density is too large for given temperature; guess must be too high
            T_high = T_guess
        else
            if (entr_guess < entr) then  ! temperature is too low
                T_low = T_guess
                if (entr-entr_guess <= scaled_zero_tol) exit bisect
            else
                if (entr_guess-entr <= scaled_zero_tol) exit bisect
                T_high = T_guess
            end if
        end if
    end do bisect

    ! Check that the loop was successful.
    if (iter >= 50) then
        error_code = 1005
        return
    end if

    ! Fully evaluate the element (this could be optimized).
    call CO2_TD(T_guess,dens,TD_error_code,pres=pres,vol=vol,inte=inte,enth=enth,cv=cv,cp=cp,ssnd=ssnd,cond=cond,visc=visc)
    if (TD_error_code == -201) error_code = -1001
    if (TD_error_code > 0) error_code = 9999  ! default error code
    if (present(temp)) temp = T_guess

    ! Calculate quality if required.
    if (present(qual)) then
        if (T_guess < T_crit) then
            call init_sat(T_guess,first_row(T_guess),sat)  ! initialize sat object
            qual = (sat%dens(1) * (sat%dens(0) - dens)) / (dens * (sat%dens(0) - sat%dens(1)))  ! based on definition of quality for specific volume, rearranged to reduce divisions
        else 
            qual = 999.0_sp  ! does not check for superheated vapor state
        end if
    end if

    return
end subroutine CO2_DS
subroutine CO2_get_error_message(error_code,error_message)
    integer, intent(in) :: error_code
    character(len=255), intent(out) :: error_message

    select case (error_code)

    ! TD Warnings and Errors
    case (-201); write (error_message,'(A)')        'CO2_TD: at least one property (CV, CP, speed of sound, thermal conductivity, or viscosity) was requested that is not available for a two-phase fluid'
    case (201);  write (error_message,'(A,F6.2,A)') 'CO2_TD: specified temperature below minimum value of ',T_low_limit,' K'
    case (202);  write (error_message,'(A,F7.2,A)') 'CO2_TD: specified temperature above maximum value of ',T_high_limit,' K'
    case (203);  write (error_message,'(A,F6.2,A)') 'CO2_TD: specified inputs result in pressure below minimum value of ',P_low_limit,' kPa'
    case (204);  write (error_message,'(A,F10.2,A)') 'CO2_TD: specified inputs result in pressure above maximum value of ',P_high_limit,' kPa'

    ! TP Warnings and Errors
    case (301);  write (error_message,'(A,F6.2,A)') 'CO2_TP: specified temperature below minimum value of ',T_low_limit,' K'
    case (302);  write (error_message,'(A,F7.2,A)') 'CO2_TP: specified temperature above maximum value of ',T_high_limit,' K'
    case (303);  write (error_message,'(A,F6.2,A)') 'CO2_TP: specified pressure below minimum value of ',P_low_limit,' kPa'
    case (304);  write (error_message,'(A,F10.2,A)') 'CO2_TP: specified pressure above maximum value of ',P_high_limit,' kPa'
    case (305);  write (error_message,'(A)')        'CO2_TP: specified temperature and pressure correspond to a saturation condition - quality is required to fully define the state'

    ! TQ Warnings and Errors
    case (-401); write (error_message,'(A)')        'CO2_TQ: at least one property (CV, CP, speed of sound, thermal conductivity, or viscosity) was requested that is not available for a two-phase fluid'
    case (401);  write (error_message,'(A,F6.2,A)') 'CO2_TQ: specified temperature below minimum value of ',T_sat_min,' K'
    case (402);  write (error_message,'(A,F8.3,A)') 'CO2_TQ: specified temperature above critical temperature of ',T_crit,' K'
    case (403);  write (error_message,'(A)')        'CO2_TQ: quality must be between 0 and 1'

    ! PQ Warnings and Errors
    case (-501); write (error_message,'(A)')        'CO2_PQ: at least one property (CV, CP, speed of sound, thermal conductivity, or viscosity) was requested that is not available for a two-phase fluid'
    case (501);  write (error_message,'(A,F6.2,A)') 'CO2_PQ: specified pressure below minimum value of ',P_sat_min,' kPa'
    case (502);  write (error_message,'(A,F8.3,A)') 'CO2_PQ: specified pressure above critical pressure of ',P_crit,' kPa'
    case (503);  write (error_message,'(A)')        'CO2_PQ: quality must be between 0 and 1'

    ! PH Warnings and Errors
    case (-601); write (error_message,'(A)')        'CO2_PH: at least one property (CV, CP, speed of sound, thermal conductivity, or viscosity) was requested that is not available for a two-phase fluid'
    case (601);  write (error_message,'(A,F6.2,A)') 'CO2_PH: specified pressure below minimum value of ',P_low_limit,' kPa'
    case (602);  write (error_message,'(A,F10.2,A)') 'CO2_PH: specified pressure above maximum value of ',P_high_limit,' kPa'
    case (603);  write (error_message,'(A)')        'CO2_PH: specified enthalpy too low for given pressure'
    case (604);  write (error_message,'(A)')        'CO2_PH: specified enthalpy too high for given pressure'
    case (605);  write (error_message,'(A)')        'CO2_PH: iteration did not converge - please contact support@nnumerics.com to report this error'

    ! PS Warnings and Errors
    case (-701); write (error_message,'(A)')        'CO2_PS: at least one property (CV, CP, speed of sound, thermal conductivity, or viscosity) was requested that is not available for a two-phase fluid'
    case (701);  write (error_message,'(A,F6.2,A)') 'CO2_PS: specified pressure below minimum value of ',P_low_limit,' kPa'
    case (702);  write (error_message,'(A,F10.2,A)') 'CO2_PS: specified pressure above maximum value of ',P_high_limit,' kPa'
    case (703);  write (error_message,'(A)')        'CO2_PS: specified entropy too low for given pressure'
    case (704);  write (error_message,'(A)')        'CO2_PS: specified entropy too high for given pressure'
    case (705);  write (error_message,'(A)')        'CO2_PS: iteration did not converge - please contact support@nnumerics.com to report this error'

    ! TS Warnings and Errors
    case (-801); write (error_message,'(A)')        'CO2_TS: at least one property (CV, CP, speed of sound, thermal conductivity, or viscosity) was requested that is not available for a two-phase fluid'
    case (801);  write (error_message,'(A,F6.2,A)') 'CO2_TS: specified temperature below minimum value of ',T_low_limit,' K'
    case (802);  write (error_message,'(A,F7.2,A)') 'CO2_TS: specified temperature above maximum value of ',T_high_limit,' K'
    case (803);  write (error_message,'(A)')        'CO2_TS: specified entropy too low for given temperature'
    case (804);  write (error_message,'(A)')        'CO2_TS: specified entropy too high for given temperature'
    case (805);  write (error_message,'(A)')        'CO2_TS: iteration did not converge - please contact support@nnumerics.com to report this error'

    ! HS Warnings and Errors
    case (-901); write (error_message,'(A)')        'CO2_HS: at least one property (CV, CP, speed of sound, thermal conductivity, or viscosity) was requested that is not available for a two-phase fluid'
    case (905);  write (error_message,'(A)')        'CO2_HS: iteration did not converge - please contact support@nnumerics.com to report this error'

    ! DS Warnings and Errors
    case (-1001); write (error_message,'(A)')        'CO2_DS: at least one property (CV, CP, speed of sound, thermal conductivity, or viscosity) was requested that is not available for a two-phase fluid'
    case (1005);  write (error_message,'(A)')        'CO2_DS: iteration did not converge - please contact support@nnumerics.com to report this error'

    
    case default; write (error_message,'(A)')        'an unknown error occurred - please contact support@nnumerics.com'
    
    end select

end subroutine CO2_get_error_message

end module CO2_properties


