enth = h0 + h/1000.0 ! in kj/kg, h is defined at 0 at 8 mpa, 301.15 k
 
call CO2_PH(pres,enth,error_code,temp=t,dens=rho,cp=cp,cond=cond,visc=mu)

alpha = cond/(cp*1000.0) ! thermal diffusivity

! initial value of dh
